"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Show Your Content Some Love – Your Optimization Checklist\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"http://blog.aweber.com/articles-tips/show-your-content-some-love-your-optimization-checklist.htm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"http://blog.aweber.com/articles-tips/show-your-content-some-love-your-optimization-checklist.htm#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 09 Feb 2015 15:31:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:15:\"Articles & Tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"content\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:17:\"digital marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:12:\"optimization\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=72337\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:190:\"When’s the last time you updated your blog? Posted on social media? Sent your customers an email? Optimized your website content? Follow these quick tips to get your content back on track.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Kristen Dunleavy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3540:\"<p><a href=\"http://blog.aweber.com/wp-content/uploads/2015/02/banner-image.png\"><img class=\"aligncenter wp-image-72340 size-large\" src=\"http://blog.aweber.com/wp-content/uploads/2015/02/banner-image-1024x219.png\" alt=\"\" /></a></p>\n<p>When’s the last time you updated your blog? Posted on social media? Sent your customers an email? Optimized your website content? If the answer to any of these is, “It’s been a while,” it’s okay. Follow these quick tips to get your content back on track.</p>\n<h2>Email</h2>\n<ul>\n<li>If you haven’t shown your email subscribers some love in a while, you may want to consider <a href=\"http://blog.aweber.com/articles-tips/how-to-reactivate-your-email-list-in-5-steps.htm\" target=\"_blank\">a reactivation campaign</a>.</li>\n<li>People who haven’t heard from you need a little refresher on your business. When you reach out to them again, show your value. Give them some useful tips or a checklist, tell them about any new product updates and/or offer them a coupon code to grab their interest again.</li>\n<li>Before you hit send, set up an A/B split test to see which subject lines resonate with your audience.</li>\n</ul>\n<h2>Social</h2>\n<ul>\n<li>How many social channels does your business use? If you’ve neglected social, you may be spreading yourself too thin. Focus on just one or two channels that make sense for your business.</li>\n<li>To get back into the social media groove, follow industry influencers to stay in touch with current news. Retweet or repost relevant information your own readers would find beneficial.</li>\n<li>Give your followers a sneak peek of new blog and email content whenever you post something new.</li>\n<li>Create a social sharing schedule and test posting messages at different times of the day. This will help your social media content get more traffic.</li>\n</ul>\n<h2>Blog</h2>\n<ul>\n<li>No time to write? Create an RSS feed of blogs in your industry. Then in your blog, you can create weekly or bi-weekly a round-up of your favorite articles.</li>\n<li>What’s going on in your industry? Pick a hot topic and explain what it means for your customers.</li>\n<li>What problem does your business solve? Why should anyone bother using your products/services? Explain why in a blog post.</li>\n<li>Look at your website analytics and check out what people are searching for on your website. Write a blog post about it.</li>\n<li>Make your blog content work for you. Tease it in your email list and on your social channels.</li>\n</ul>\n<h2>Website</h2>\n<ul>\n<li>Test your existing website copy to see what’s working and what isn’t.</li>\n<li>Give some love to your <a href=\"http://moz.com/learn/seo/title-tag\">title tag</a> &#8211; this is what shows up in search engine results, so make sure it reflects your targeted keywords.</li>\n<li>Adjusting your header tags (these are your post titles &#8211; the H1s) to reflect your keyword will also help your website pop up more in searches.</li>\n<li>Take a look at your website copy in terms of features vs. benefits. Does your business help save your customers time? Money? Hassle? Put your business’s benefits at the forefront of all your website copy.</li>\n</ul>\n<p>Don’t sweat it if you haven’t been able to give your content the attention it deserves. Your content will always be a work in progress &#8211; don’t be afraid to test, adjust and try again!</p>\n<p>Want to grow your business with email marketing? <a href=\"https://www.aweber.com/order.htm\">Get started with AWeber today for just $1</a>!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"http://blog.aweber.com/articles-tips/show-your-content-some-love-your-optimization-checklist.htm/feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:54:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"How to Write an Autoresponder Email Series\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://blog.aweber.com/articles-tips/how-to-write-an-autoresponder-email-series.htm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://blog.aweber.com/articles-tips/how-to-write-an-autoresponder-email-series.htm#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 Feb 2015 15:23:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:15:\"Articles & Tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:16:\"automated emails\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:14:\"autoresponders\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:7:\"content\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:10:\"follow ups\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=72075\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:274:\"Autoresponder emails (commonly called follow up emails) have a ton of time-saving and business-growing benefits - and yet 75 percent of businesses aren’t using them. Here\'s how to plan, write and execute an AWesome follow up series to put your business ahead of the curve.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Kristen Dunleavy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6194:\"<p><a href=\"http://blog.aweber.com/wp-content/uploads/2015/02/followups-411-blogimg.png\"><img class=\"aligncenter size-full wp-image-72077\" src=\"http://blog.aweber.com/wp-content/uploads/2015/02/followups-411-blogimg.png\" alt=\"\" width=\"700\" height=\"110\" /></a></p>\n<p>Autoresponder emails (sometimes called autoresponder follow up emails or just follow up emails) have a ton of time-saving and business-growing benefits &#8211; and yet <a href=\"http://marketingland.com/auto-responders-why-trigger-based-email-will-increase-your-conversions-43839\">75 percent </a>of businesses aren’t using them. What does that mean for you? Add a follow up series to your email marketing strategy today, and BAM! You’re already ahead of the curve.</p>\n<h2>Why are follow ups important?</h2>\n<p>Follow up emails let you schedule an entire series of emails ahead of time for your new subscribers. Unlike broadcast emails, which are one-time emails with time-sensitive content (think emails promoting holiday sales or weekly newsletter updates), the content in a follow up series is evergreen. That means you can send a follow up series to any new subscriber at any time of the year.</p>\n<p>How do they work? As soon as a new subscriber signs up, they automatically receive your series. Every follow up series should follow an arc: an introduction to your business in the beginning, information about your products or services in the middle and a survey asking for feedback at the end.</p>\n<p>This saves you the hassle of sending the same information over and over again <em>and</em> gives you the opportunity to make a great first impression.</p>\n<p>If you’re a personal trainer, for example, you need your subscribers to feel comfortable about booking their first session with you. Show them how knowledgeable and professional you are with your follow up series (share workout tips, nutrition knowledge and more) and your calendar will be packed in no time. That’s how you build trust and turn subscribers into paying customers.</p>\n<p>Now, let’s write some follow up emails.</p>\n<h2>How should I plan my follow up series?</h2>\n<p>First, define your goal for each email in your series. For example, if you’re a nutritionist, you might start off with answering common health questions you’ve received from clients in the past. The number of emails is up to you and how much content you want to create. That can mean as few as three or as many as 20 emails.</p>\n<p>Next, decide on a sequence that makes sense for your customers. If you’re teaching new customers how to use a product, your series should have an obvious beginning, middle and end, with enough space in between to digest your lessons &#8211; try a one or two day buffer.</p>\n<p>If you want your new subscribers to take a certain action within a certain time period, take that into consideration too. For example, if you want them to upgrade their service within 30 days of signing up for your list, your series should lead them there.</p>\n<h2>What should I write in my follow up series?</h2>\n<p>Writing a follow up email series doesn’t have to be scary. Here are some topics that any business owner can write about:</p>\n<ul>\n<li>FAQs about your business</li>\n<li>Ways that your products or services can save time and/or money</li>\n<li>Customer spotlight/case studies</li>\n<li>Industry insights</li>\n<li>Get to know the team</li>\n<li>Tips for success</li>\n<li>A survey asking for feedback</li>\n<li>Additional resources to educate and assist your subscribers</li>\n</ul>\n<p>You can try a combination of the ideas listed above for your series. Here’s an example of a follow up series a local realtor might use for those looking to rent an apartment or house:</p>\n<ol>\n<li>Ask a Realtor: FAQ</li>\n<li>5 Time-Saving Tricks for Your Apartment Hunt</li>\n<li>How One Family Found the Perfect Pet-Friendly Place</li>\n<li>To Rent or To Buy? An Expert Weighs In</li>\n<li>Meet the Seaside Realty Team</li>\n<li>3 Questions to Ask Your Landlord</li>\n<li>We Want To Hear From You!</li>\n</ol>\n<p>… and so on. Another approach you can take with your content is to use your follow up series as a step-by-step guide to educate your subscribers on using your products or services. If you’re an online retailer selling aquarium equipment to new customers, you might create a step-by-step guide to using your product that looks like this:</p>\n<ol>\n<li>Setting Up Your Aqua Reef Lights in 3 Easy Steps</li>\n<li>Troubleshooting: Common Problems and How to Fix Them</li>\n<li>How To Maximize Your New Aqua Reef Lights</li>\n<li>How Do You Like Your New Aqua Reef Lights?</li>\n</ol>\n<p>Regardless of the type of series you use, remember that every follow up series is sequential. That means the information you present should make sense in the order you send it. Send yourself a test of the entire series to make sure it does.</p>\n<h2>What else do I need to know about follow ups?</h2>\n<p>You don’t have to jam everything you know into your follow up series. Save news, coupon offers and weekly specials for your broadcast emails. Use your blog for longer-form pieces like thought leadership articles.</p>\n<p>Keep your subscribers’ attention span in mind &#8211; 300 words is plenty for one email. If your follow up series is a guide to using your services, pepper in an email or two asking your subscribers for feedback.</p>\n<p>Once you have your series set up, create a calendar reminder so you can make regular updates to your series. This ensures that you keep your follow up content fresh and gives you the opportunity to make updates if something changes in your business.</p>\n<blockquote><p>Pro-tip: You can also update and optimize your series based on your open rates. For example, if email number six gets low opens, consider changing the subject line or swapping its place with another email, if possible.</p></blockquote>\n<p>If you’re interested in turning your subscribers into paying customers (and really, who isn’t?) a follow up series is one of the best ways to do just that.</p>\n<p>Want to keep tabs on your AWeber emails any time, anywhere? <a href=\"http://www.aweber.com/mobile-app.htm\">Download the AWeber app today</a>!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"http://blog.aweber.com/articles-tips/how-to-write-an-autoresponder-email-series.htm/feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"4 Traits of the Small Business Owner: An Infographic\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://blog.aweber.com/articles-tips/4-traits-of-the-small-business-owner-an-infographic.htm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"http://blog.aweber.com/articles-tips/4-traits-of-the-small-business-owner-an-infographic.htm#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 04 Feb 2015 15:00:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:15:\"Articles & Tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:17:\"Digital Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:15:\"customer survey\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:11:\"infographic\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=72055\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:129:\"How do small business owners plan to succeed in 2015? AWeber asked nearly 1,500 entrepreneurs to find out. Hint: They love email.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Kristen Dunleavy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3396:\"<p><a href=\"http://blog.aweber.com/wp-content/uploads/2015/02/2015Info-featureimgs-blogheader.png\"><img class=\"aligncenter size-full wp-image-72059\" src=\"http://blog.aweber.com/wp-content/uploads/2015/02/2015Info-featureimgs-blogheader2.png\" alt=\"\" width=\"701\" height=\"98\" /></a></p>\n<p>If there&#8217;s one thing that most entrepreneurs have in common, it&#8217;s that there aren&#8217;t enough hours in one day. Between daily operations, growing a customer base, and you know, running a business, it&#8217;s safe to say that entrepreneurs are multitasking masters.</p>\n<p>So how do they do it? According to nearly 1,500 small business owners, email marketing will play a big role in their continued success for 2015. Entrepreneurs plan to focus on lots of digital content &#8211; particularly email &#8211; throughout the year. And considering that 70 percent of them are generating additional revenue using email, it&#8217;s no wonder it&#8217;s become the marketing medium of choice.</p>\n<p>Other reasons why people love email? Time-saving features like autoresponders (a.k.a follow ups), dependable deliverability and newsletter scheduling help entrepreneurs get the most out of every busy day.</p>\n<p>Check out what else small business owners are doing to maximize their time in the infographic below.</p>\n<p><a href=\"//www.pinterest.com/pin/create/button/?url=http%3A%2F%2Fblog.aweber.com%2Farticles-tips%2F4-traits-of-the-small-business-owner-an-infographic.htm%3Futm_source%3Dblogpostshare%26utm_medium%3Dsocial%26utm_content%3Dpinterest&amp;media=http%3A%2F%2Fblog.aweber.com%2Fwp-content%2Fuploads%2F2015%2F02%2F2015info_final.jpg&amp;description=4%20Traits%20of%20the%20Small%20Business%20Owner%20%23Infographic%20%23AWeber\" data-pin-do=\"buttonPin\" data-pin-config=\"none\" data-pin-color=\"red\" data-pin-height=\"28\"><img src=\"//assets.pinterest.com/images/pidgets/pinit_fg_en_rect_red_28.png\" alt=\"\" /></a><br />\n<!-- Please call pinit.js only once per page --><br />\n<script src=\"//assets.pinterest.com/js/pinit.js\" async=\"\" defer=\"defer\" type=\"text/javascript\"></script><a href=\"http://blog.aweber.com/wp-content/uploads/2015/02/2015info_final.jpg\"><img class=\"aligncenter size-full wp-image-72057\" src=\"http://blog.aweber.com/wp-content/uploads/2015/02/2015info_final.jpg\" alt=\"\" width=\"700\" height=\"1938\" /></a></p>\n<p>&nbsp;</p>\n<p><i>Want to embed this infographic on your blog or website? Just copy and paste the code below:</i></p>\n<p><textarea style=\"height: 100px; width: 700px; border: 1px solid black; padding: 3px;\"><a title=\"4 Traits of the Small Business Owner: An Infographic\" href=\"http://blog.aweber.com/articles-tips/4-traits-of-the-small-business-owner-an-infographic.htm?utm_source=embed&#038;utm_medium=blog&#038;utm_content=custinfographic15&#038;utm_campaign=infographic\"><img src=\"http://blog.aweber.com/wp-content/uploads/2015/02/2015info_final.jpg\" title=\"4 Traits of the Small Business Owner: An Infographic\"  style=\"max-width:960px; padding:20px; text-align:center;\" width=\"100%\"/></a><br /><em>Data and infographic by <a title=\"AWeber Email Marketing\" href=\"http://www.aweber.com?utm_source=embed&#038;utm_medium=blog&#038;utm_content=custinfographic15&#038;utm_campaign=infographic\">AWeber</a></em></textarea></p>\n<p class=\"p1\">\n<p class=\"p1\">\n<p class=\"p1\">Which types of digital content are you focusing on for 2015? Tell us in the comments!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"http://blog.aweber.com/articles-tips/4-traits-of-the-small-business-owner-an-infographic.htm/feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:87:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"AWeber + Rainmaker Platform = Content Marketing’s New Dynamic Duo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"http://blog.aweber.com/integrations-2/aweber-rainmaker-platform-content-marketings-new-dynamic-duo.htm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a