attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:11;a:5:{s:4:\"data\";s:9:\"Rainmaker\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:12;a:5:{s:4:\"data\";s:15:\"recommendations\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:13;a:5:{s:4:\"data\";s:12:\"Robert Bruce\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:14;a:5:{s:4:\"data\";s:8:\"strategy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:15;a:5:{s:4:\"data\";s:5:\"video\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=72020\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:209:\"Want to invest more time creating epic content to build your business, and less time wrangling with the back-end tech parts? Check out Rainmaker Platform, one of our newest, most powerful integration partners.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Hunter Boyle\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4706:\"<p><img class=\"aligncenter wp-image-72051 size-large\" src=\"http://blog.aweber.com/wp-content/uploads/2015/02/blog-banner-1024x219.png\" alt=\"blog-banner\" width=\"640\" height=\"136\" /></p>\n<p>Content marketing entrepreneurs: What’s your biggest challenge right now?</p>\n<p>How to launch or grow your digital business? Increase your productivity? Produce or curate more world-class content?<i> All of the above?</i></p>\n<p>You’ll be glad to know you’re not alone.</p>\n<p>Most of us are grappling with those same issues &#8212; <a href=\"http://bit.ly/1nCBI7Y\">even the leaders in the marketing field</a>.</p>\n<p>Everyone craves more time and energy to invest in epic blog posts, podcasts, courses and ebooks. But all too often, we get bogged down in the nuts and bolts of content management: tweaking themes, plug-ins, upgrades, hosting and other distracting minutiae.</p>\n<p>That’s exactly why the Copyblogger Media team developed <a href=\"http://newrainmaker.com/\">Rainmaker Platform</a>, one of our newest, most powerful integrations.</p>\n<h2>You Focus On Content, We’ll Handle The Techy Bits</h2>\n<p>Not every blog will <a href=\"http://newrainmaker.com/audio/behind-the-scenes-4/\">evolve into an eight-figure business</a>. You may not be aiming that high, but you can still reap the benefits of Copyblogger’s journey, because Rainmaker combines the suite of tools with the training to optimize them &#8212; and it works perfectly with email marketing.</p>\n<p>“Email remains the most intimate touchpoint we can have with our audience,” says Jerod Morris, Copyblogger Media’s VP of marketing. “That’s why all public-facing content should focus on driving people to an email list. Rainmaker makes integrating email capture much simpler and more seamless, so you can fiddle less with the technology and code and spend more time delivering the value that will drive sign-ups.”</p>\n<p>Check out this sneak peek of the Rainmaker Platform, and how it hooks up to AWeber, to get a sense for how it might help your business:</p>\n<p><iframe class=\"wistia_embed\" src=\"//fast.wistia.net/embed/iframe/908pwj5ixy?videoFoam=true\" name=\"wistia_embed\" width=\"500\" height=\"309\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<h2>See AWeber and Rainmaker In Action: Further.net</h2>\n<p>It’s cool to see hundreds of sites already using the Rainmaker-AWeber integration. What’s even cooler is that you can see it in action with a new, fast-growing website: <a href=\"http://further.net/\">Further.net</a>.</p>\n<p>The site is all about “living your best life” and you can learn a ton from the curation strategy and launch plan. Listen to “curator-in-chief” Brian Clark and Robert Bruce of Copyblogger discuss the goals, early results and takeaways on these Rainmaker.FM podcast episodes:</p>\n<ol>\n<li><a href=\"http://newrainmaker.com/audio/content-curation-positioning/\">Position Your Content Curation for Success With These 5 Essential Elements</a></li>\n<li><a href=\"http://newrainmaker.com/audio/curated-email-list/\">3 Ways to Grow Your Curated Email Newsletter Faster</a></li>\n<li><a href=\"http://newrainmaker.com/audio/curation-traffic-strategies/\">5 Traffic Strategies That Build Your Curation Audience</a></li>\n</ol>\n<p><strong>Bonus:</strong> <a href=\"http://www.copyblogger.com/aweber-studiopress-themes/\">You can easily match your Rainmaker site design to AWeber emails</a>, with email templates based on popular StudioPress themes.</p>\n<h2>What Now? Learn More, Try Rainmaker For Free</h2>\n<p>The suite of tools and functionality built into Rainmaker makes it an ideal choice for online marketers with content products, membership sites and affiliate programs. You can even kick the digital tires with a <a href=\"http://newrainmaker.com/\">14-day free trial</a>.</p>\n<p>If you want to learn even more about how to put the platform to work for you, you can get smarter and have fun at the <a href=\"http://my.copyblogger.com/authority-rainmaker/\">Authority Rainmaker live event</a> in Denver, May 13-15. AWeber is an event sponsor and host of the Friday night party (#howweroll), so come out and meet our team.</p>\n<p>Plus, we’re excited to have Jerod Morris, VP of Marketing for Copyblogger Media, as a featured speaker at our <a href=\"http://www.ascendsummit.com/?utm_source=AWeber&amp;utm_medium=blog&amp;utm_campaign=ASCEND_2015&amp;utm_content=rainmaker\">ASCEND Digital Marketing Summit</a> in Philly, Oct. 18-20.</p>\n<p>So, you can keep your content marketing knowledge sharp throughout the year, put this dynamic duo to work for you and make 2015 all about optimizing your business for growth. How’s that sound?  <strong> </strong></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"http://blog.aweber.com/integrations-2/aweber-rainmaker-platform-content-marketings-new-dynamic-duo.htm/feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"Email Marketing &amp; Public Relations: A Match Made In The Inbox\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://blog.aweber.com/articles-tips/email-marketing-public-relations-a-match-made-in-the-inbox.htm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"http://blog.aweber.com/articles-tips/email-marketing-public-relations-a-match-made-in-the-inbox.htm#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 30 Jan 2015 17:00:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:7:{i:0;a:5:{s:4:\"data\";s:15:\"Articles & Tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:15:\"Email Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:9:\"marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:15:\"Murray Newlands\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:16:\"public relations\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:35:\"public relations for small business\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:6;a:5:{s:4:\"data\";s:28:\"public relations for startup\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=71973\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:246:\"Public relations is a great way to boost your audience\'s perception of your brand. In this Q&#038;A, we talked to PR expert Murray Newlands to find out the best ways small business owners can maximize their PR efforts along with email marketing. \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Andrea Carter\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7439:\"<p><img class=\"aligncenter wp-image-71983 size-full\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/blog-banner2.png\" alt=\"AWeber-PublicRelationsEmailMarketing\" width=\"700\" height=\"150\" /></p>\n<p>&nbsp;</p>\n<p>In his book <a href=\"http://www.startupprbook.com/\" target=\"_blank\"><i>How to Get PR for Your Startup: Traction</i></a>, author and expert Murray Newlands offers these words of advice for today’s business owner: <i>“The business that can influence the media will win the trust of the people &#8211; simply because consumers typically decide to purchase from brands they trust and are familiar with.”</i></p>\n<p>As someone who works in public relations, I confess, this statement gave me goosebumps. If ever there was a case for the value of public relations (PR), Murray nailed it.</p>\n<p>My own interests aside, Murray’s point is especially relevant to small business owners. Why? Because brand awareness is crucial in the early stages of launching a business. And PR can be one of the keys to getting your business from startup to grownup.</p>\n<p>With that said, there’s opportunity to put PR to work for you and your business by syncing it with your email marketing efforts. I connected with Murray to get his advice on how to combine PR and email marketing for maximum effectiveness. Here’s what he had to say:</p>\n<p>&nbsp;</p>\n<p><em><b>Andrea Carter (AC): First things first, why is PR important for small business owners?</b></em></p>\n<p><b>Murray Newlands (MN):</b> When consumers make a purchase, they often search the product or service on Google to see what people say about it. Public relations can help ensure people read positive things about your company when they’re making purchasing decisions. One of the goals of PR is for a company to receive press coverage, whether in a newspaper or magazine, on a website, or on television or radio. This type of media coverage is particularly important for small business owners because the more people get to know you, your business or the products and services you offer, the bigger your chances of making a sale when reaching out to target customers.</p>\n<p>&nbsp;</p>\n<p><em><b>AC:</b> <b>What’s your 15-second pitch on how to effectively reach out to news media?</b></em><b><br />\n</b></p>\n<p><b>MN:</b> When engaging in media outreach, focus your efforts on how your company helps people with problems. Publication readers have problems, and they are hungry to read about how to overcome their problems. Press members normally don’t want to write about companies; but they <i>will</i> write about problems and how your company helps solve those problems.</p>\n<p>&nbsp;</p>\n<p><em><b>AC:</b> <b>I agree 100 percent. Getting great press coverage means less of a company sales pitch and more about how that company is solving problems. So for the email marketers out there, how can they include PR strategies in their email marketing?</b></em></p>\n<p><b>MN:</b> PR and email are great tools to help each other. If you send out recent media placements to prospects, it acts as a third party endorsement and they will be more likely to use your services or buy your products. When you get great press coverage and include a link to it in your marketing emails and newsletters, it helps to reassure customers that they’ve made the right choice in using you.</p>\n<p>&nbsp;</p>\n<p><em><b>AC:</b> <b>So how is it done? Describe a few ways business owners can incorporate PR strategies into their marketing emails and newsletters.</b></em></p>\n<p><b>MN:</b> First, don’t just think about PR as publications and media outreach; also think about customers sharing your newsletters. It is important that you involve social icons within your email campaigns. I’m not talking about putting a small Twitter or Facebook icon some place at the bottom of the email. Ask email subscribers to connect with you on social and to share your press hits. Use a ‘Retweet This!’ or a ‘Share This!’ in the email. Occasionally, social icons aren’t enough. While most subscribers will recognize the LinkedIn/Twitter/Facebook icons, not every person will know what action to take as they view them within your marketing email. Don’t hesitate to tell them!</p>\n<p>&nbsp;</p>\n<p><em><b>AC:</b> <b>That’s a great tip to remember. An explicit call to action is always necessary. </b><b>As a PR person, I know firsthand that media coverage is hard to come by. What happens if a business owner has press coverage to share one week, then nothing to share the next?</b></em></p>\n<p><b>MN: </b>This is a great opportunity to ensure your email newsletter and marketing messages are multi-dimensional. If there is no press coverage to share, use language such as “thought you would enjoy the following” and insert a related story. There’s always something out there related to what you do that can bring value to your audience. It can be as simple as doing a quick Google search.</p>\n<p>&nbsp;</p>\n<p><em><b>AC: Speaking of bringing value to the audience, do customers care about PR? What’s in it for them?</b></em></p>\n<p><b>MN: </b>If done correctly, the customer feels as though they have more information and a better relationship with the brand. At the end of the day, customers and prospects don’t just want to buy a product, they also want to feel good about it.</p>\n<p>&nbsp;</p>\n<p><em><b>AC: Do business owners run the risk of being too self-promotional by incorporating PR tactics into their email marketing?</b></em></p>\n<p><b>MN: </b>No, the business owner’s first priority should be to offer valuable information to their customers and clients. PR should be of value to the readers and customers.</p>\n<p>&nbsp;</p>\n<p><em><b>AC:</b> <b>How can a small business owner use email marketing to fuel more media opportunities for their business?</b></em></p>\n<p><b>MN:</b> Publications and journalists love stories with data and facts. Email marketing is a great way to run surveys that can provide terrific data and great ideas for articles.</p>\n<p>&nbsp;</p>\n<p><em><b>AC: If I’m a small business owner who’s reading this, where do I start?</b></em></p>\n<p><b>MN: </b>The key is getting your amazing story out, even if it isn’t the initial thing you believed would be intriguing. Check out the focus of your target news publications and outlets. If it’s a local magazine, newspaper, or website that solely covers local businesses, concentrate on that angle. If it’s an international or national television program, search for something that will have a lot of interest, yet possesses a unique perspective that brings something fresh to the table. You should make it clear why audiences in different regions of the world or country might be curious about your story. I explain more about these tips in my book: <a href=\"http://www.startupprbook.com/\" target=\"_blank\"><i>How to Get PR for your Startup: Traction</i></a>.</p>\n<p>&nbsp;</p>\n<h2><b>How To Include PR Into Your Business</b></h2>\n<p>If you’re a business owner who’s just getting started, I recommend <a href=\"http://www.startupprbook.com/\" target=\"_blank\">checking out</a> Murray’s book. It’s a quick read that’s chock-full of strategies and tactics to include PR in email marketing and other areas of your business.</p>\n<p>Have your own tips for pairing email marketing with public relations? Use the comments section to tell us what’s worked for you!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"ht