";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:9:\"analytics\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:15:\"Email Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:9:\"marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:12:\"optimization\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:6;a:5:{s:4:\"data\";s:13:\"split testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:7;a:5:{s:4:\"data\";s:7:\"testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=71979\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:205:\"If you\'re not testing your marketing efforts, you could be missing out on big opportunities to improve conversions and sales. Learn how you can boost your marketing with these easy-to-follow testing tips! \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Jessica Celenza\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7551:\"<p><img class=\"aligncenter size-full wp-image-71981\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/split-test-blogimg.png\" alt=\"AWeber-TestsToOptimizeMarketing\" width=\"700\" height=\"110\" /></p>\n<p>&nbsp;</p>\n<p>You’ve probably heard time and time again about the concept of testing and optimization (a.k.a conversion rate optimization or CRO). But if you’re not quite sure what it means, that’s okay.</p>\n<p>Optimization refers to the process of improving your marketing efforts in order to maximize your desired business outcome. In other words, it’s all about testing and refining your marketing tactics to ensure they’re delivering the best results possible.</p>\n<p>How effective is it, you wonder? According to Optimizely, SaaS companies saw a 17 percent increase in customer engagement after optimizing their websites. As for ecommerce businesses, they saw a 21 percent increase in revenue. And that’s only <a href=\"http://2nwl40151nra3yah86118nxtto0.wpengine.netdna-cdn.com/wp-content/uploads/2014/01/AB-Advantage-ab-testing.png\" target=\"_blank\">a small glimpse into the possible benefits</a>.</p>\n<p>So what does that mean for you and your business?</p>\n<p>Improving tactics such as content, visuals and headlines, allows you to better communicate with your audience. When you have clear website copy, for example, it becomes easier for visitors to understand how your brand can help them and the best ways to get that help.</p>\n<p>Testing also gives you a sense of which marketing tactics are and are not working &#8212; which can help you save time and money in the long run.</p>\n<p>Ready to get started? Here’s what you should know.</p>\n<p>&nbsp;</p>\n<h2><b>Assess Your Marketing Performance</b></h2>\n<p>To determine what you should test, you’ll want to <a href=\"http://blog.aweber.com/articles-tips/analytics-101-how-to-use-analytics-to-refresh-your-email-marketing.htm\" target=\"_blank\">review your analytics</a>. Take some time to evaluate the current performance of your marketing campaigns and website to identify what has the biggest opportunity for improvement.</p>\n<p>While there are hundreds of ways you can improve your digital marketing, it’s important to focus on one area at a time. If you find that your blog, paid search, and email marketing could all use a boost, you might want to build a list of areas to test and work your way down.</p>\n<p>Other marketing tactics you could test include social media (e.g. paid ads), your website funnel (e.g. site traffic, bounce rate, conversion rate) and any lead generation efforts. If you offer an incentive such as a white paper to collect email addresses, optimization can help you improve its effectiveness.</p>\n<p>&nbsp;</p>\n<h2><b>Your Testing Checklist</b></h2>\n<p>Once you’ve chosen an area to test, be sure to keep these best practices in mind before you begin:</p>\n<p><b>Create a hypothesis.</b> Remember writing hypotheses for science experiments during your school years? Here’s when that old skill comes in handy. For every test you perform, it’s important to have a clear idea of what you’re testing, why you’re testing it and what you think the outcome will be. This not only helps you stay organized, it also allows you to learn from each test.</p>\n<p><b>NEVER assume you know the answer.</b> While hypotheses are important to any test, remember that they are simply <i>guesses.</i> As marketers, business owners and experts in our fields, we have a tendency to think we know what’s best. However, what <i>we</i> think is right may not always be right for the customer. Be open to testing new ideas and tactics &#8212; you never know what you might learn about your audience.</p>\n<p><b>Run your tests long enough.</b> In order to know whether or not an increase or decrease in performance is real or skewed due to not having enough data, you have to make sure your test results reach statistical significance. (After all, statistical significance is the key to testing!). Many experts say to run your test for at least two full business weeks to account for varying performance on days of the week, holidays, business cycles, etc.</p>\n<blockquote><p>For those of you who fell asleep in your Stats 101 course, there are plenty of tools that can help you figure out the success of your A/B test. You can try this <a href=\"https://vwo.com/ab-split-test-significance-calculator/\" target=\"_blank\">split testing calculator</a> to get the info you need!</p></blockquote>\n<p><b>Isolate changes as often as possible.</b> While there are several testing options, the standard A/B split testing (testing only two different versions) is the most common and easiest to implement. If you throw in a bunch of new details, such as a new headline, image, CTA copy and pricing information, it’s going to be difficult to say which change affected the conversion rate and why. Test one change at a time so you can see which change works and what doesn’t.</p>\n<p><b>Don’t give up because your test failed.</b> A failure in the world of testing is still extraordinarily valuable to any business! It gives you an opportunity to discover what doesn’t work. Think about it: If you want to change your CTA from &#8220;Learn More&#8221; to &#8220;Buy Now,&#8221; performing a test is the only way to know if the change will truly be effective. If you just rolled out the change, your website might have performed at a lower rate and you wouldn’t have known why.</p>\n<p><b>ALWAYS test!</b> Just because you see success in a few tests doesn’t mean you should consider your testing program complete. There is always room for improvement, and there may be other tactics or details that can be tested. To maintain a steady testing cadence, try launching a new test within a week of completing the last one.</p>\n<p>&nbsp;</p>\n<h2><b>3 Ideas to Start Testing Today!</b></h2>\n<p>If you’re thinking about trying a test or two of your own, here are a few ideas you can easily implement:</p>\n<p><b>1. Create urgency in messaging.</b> We tried it here at AWeber and found that simply <a href=\"http://www.aweber.com/\" target=\"_blank\">adding the word “now” to our call to action</a> increased trial signups by 12.8 percent!</p>\n<p><b>2. Try different colors.</b> Researchers have discussed the psychology behind color for years, so it’s no surprise that specific <a href=\"http://visual.ly/meaning-colour-marketing\" target=\"_blank\">colors are used to convey certain meanings or influence consumer behavior </a>too. Green, for example, triggers different emotional response than red, yellow or blue. It’s often associated with taking action (think of the meaning of a green traffic light) or nature. When creating an offer to customers, consider the color of the button, text or even background to evoke specific actions from your audience.</p>\n<p><b>3. Add customer testimonials.</b> Social proof goes a long way in gaining the trust of new customers. Real examples of how your product or service has helped current customers can positively impact new business.</p>\n<blockquote><p>Need help creating a test? Check out a couple of our integration partners – <a href=\"https://help.aweber.com/hc/en-us/articles/204031556-How-Do-I-Integrate-LeadPages-With-AWeber-\" target=\"_blank\">LeadPages</a> and <a href=\"https://help.aweber.com/hc/en-us/articles/204031266-How-Do-I-Integrate-Unbounce-With-AWeber-\" target=\"_blank\">Unbounce</a> – to get started.</p></blockquote>\n<p>Do you have other test ideas of your own? Share them in the comments below!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"http://blog.aweber.com/articles-tips/how-to-run-quick-easy-tests-to-optimize-your-marketing.htm/feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\"