_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=71930\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:194:\"Need help with things like SEO, managing social media and creating effective landing pages? Check out these must-have digital marketing tools that\'ll make growing your business online a breeze. \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Hunter Boyle\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7101:\"<p><img class=\"aligncenter wp-image-71949 size-full\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/banner_image1.png\" alt=\"\" width=\"700\" height=\"110\" /></p>\n<p>Email is a critical part of your marketing and sales lifecycle, but it’s only one piece of the bigger digital marketing puzzle. You still need a website, landing pages, compelling content, traffic-driving campaigns, testing tools and analytics to be successful.</p>\n<p>While there’s no magic service that rolls all of those elements together, here’s the next best thing: <a href=\"http://www.digitalmarketerskit.com/\" target=\"_blank\">AWeber is part of a new digital marketing toolkit</a> featuring nine of the best services in those areas. Plus, the toolkit includes exclusive discounts to get you started.</p>\n<h2>The Best Tools To Optimize Your Digital Marketing</h2>\n<p>Along with <a href=\"http://www.aweber.com/protoolkit.htm\" target=\"_blank\">AWeber</a> (an easy-to-use solution to power your email marketing endeavors), the Marketer’s Toolkit includes some of our SaaS-iest (<i>see what we did there?</i>) digital peeps.</p>\n<p>Here’s the low-down on our eight partners and what they can do for you:</p>\n<h3>1. Hootsuite</h3>\n<p><a href=\"https://hootsuite.com/plans/pro-upgrade?upgrade\" target=\"_blank\">This popular tool</a> helps you manage social networks like Twitter, Facebook and LinkedIn, schedule messages, engage your audiences and measure your social media ROI. If you’re still not convinced social media is worth your time, check out how <a href=\"https://hootsuite.com/resources/case-study/purematter-case-study\" target=\"_blank\">PureMatter used Hootsuite to close a $1 million deal and increase sales by 15 percent</a>.</p>\n<h3>2. Hubspot</h3>\n<p>The leading software platform for inbound marketing and sales, <a href=\"http://offers.hubspot.com/free-trial?source=hscm-unbounce-free-trial-20150120\" target=\"_blank\">HubSpot</a> helps increase your company’s online visibility, generate more leads, and convert more visitors to customers. Better still, they complement the service with a steady stream of educational content and resources, from their <a href=\"http://blog.hubspot.com/\" target=\"_blank\">outstanding blogs</a> to a whole site section packed with <a href=\"http://www.hubspot.com/customers\" target=\"_blank\">customer success stories</a>.</p>\n<h3>3. KISSmetrics</h3>\n<p>You need <a href=\"https://www.kissmetrics.com/marketer-toolkit\" target=\"_blank\">customer insights and analytics</a> to grow your business, period. Why? Because it’s good to know what your prospects and customers are doing on your site, where they’re having problems and anything else that might prevent them from making a purchase. Those kinds of insights helped social tool <a href=\"https://www.kissmetrics.com/customers/buffer\" target=\"_blank\">Buffer add $25,000 in revenue in one month</a>. For more digital marketing (and even <a href=\"https://blog.kissmetrics.com/why-email-marketing-fails/\" target=\"_blank\">email optimization</a>) insights and tactics, don’t forget to check out the <a href=\"https://blog.kissmetrics.com/\" target=\"_blank\">KISSmetrics blog</a>.</p>\n<h3>4. Moz</h3>\n<p>If you don’t know <a href=\"http://moz.com/partner/theprofessionalmarketerstoolkit\" target=\"_blank\">Moz</a>, you’re missing out. Originally focused on SEO (and formerly known as SEOMoz), the company now offers a broader toolset that encompasses SEO, social, content, link building and local listings. You can even gain access to the “<a href=\"http://moz.com/community\" target=\"_blank\">Moz Community</a>,” where customers can interact with and help one another become better online marketers. It’s also a prime example of how connecting your clients and fans cultivates a passionate, loyal community — online and offline.</p>\n<h3>5. Optimizely</h3>\n<p>With <a href=\"https://www.optimizely.com/\" target=\"_blank\">one of the fastest-growing optimization platforms</a> for websites and mobile apps, you can significantly improve your marketing tests. Let’s say you need to increase leads. Maybe you’d test different testimonial layouts on your webpage, and <a href=\"https://www.optimizely.com/customers/customer-stories/\" target=\"_blank\">get a 69 percent increase in conversions, like ComScore did</a>. If your goal is to increase results with A/B or multivariate testing, now you know where to start. In addition to a <a href=\"http://blog.optimizely.com/category/casestudies/\" target=\"_blank\">blog section devoted to case studies</a>, the <a href=\"https://learn.optimizely.com/hc/en-us\" target=\"_blank\">Optimizely Academy</a> teaches marketers at any skill level about optimization.</p>\n<h3>6. Unbounce</h3>\n<p>The catalyst and driving force behind this toolkit, our friends at <a href=\"http://try.unbounce.com/marketers-toolkit/\" target=\"_blank\">Unbounce</a> have a powerful and straightforward value proposition: Build, publish and A/B test landing pages without IT. How it works: Pick a mobile-responsive landing page from their extensive collection, customize with your content, publish, test, analyze and optimize. <a href=\"http://unbounce.com/partners/aweber/\" target=\"_blank\">Add your Unbounce leads right to your AWeber account</a>. Learn a ton from <a href=\"http://unbounce.com/blog/\" target=\"_blank\">the Unbounce blog</a>, plus <a href=\"http://unbounce.com/resources/\" target=\"_blank\">guides, Unwebinars and more</a>. Dominate, rinse, repeat.</p>\n<h3>7. Wistia</h3>\n<p>When it comes to video hosting for marketers, <a href=\"http://wistia.com/trials/new/marketerstoolkit\" target=\"_blank\">Wistia</a> goes beyond just the hosting part of the equation. Not only can you upload and customize your video to match your website design, review analytics, and even grow your email audience, Wistia also makes an outstanding effort to support and educate clients. And best of all, <a href=\"https://home.wistia.com/medias/hmpwfxi3qs\" target=\"_blank\">the Wistia crew also knows how to have fun</a>, which is what you want from your partners.</p>\n<h3>8. WordStream</h3>\n<p>If you thought paid search was out of reach, or you’ve been shopping around for a provider that makes PPC campaign management easier, you should get to know the team at <a href=\"http://marketing.wordstream.com/ppc-free-trial-WS-2015-Professional-Marketers-Toolkit.html\" target=\"_blank\">WordStream</a>. They put the tools for optimizing PPC campaigns together with the educational resources like <a href=\"http://www.wordstream.com/learn\" target=\"_blank\">PPC University</a> and <a href=\"http://www.wordstream.com/blog\" target=\"_blank\">an active blog</a> to help you improve ROI with this critical traffic-driving channel.</p>\n<h2>The Next Move Is Yours</h2>\n<p>Ready to take your digital marketing to the next level?</p>\n<p>Whether you need only one of these power tools or the full collection, you’re bound to benefit from trying them out with these exclusive offers.</p>\n<p><strong><a href=\"http://www.digitalmarketerskit.com/\" target=\"_blank\">Check out the Marketer&#8217;s Toolkit here</a> </strong>to learn more and get started today.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"http://blog.aweber.com/products/marketers-toolkit-9services.htm/feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"9 Ways You Can Become An Affiliate All-Star\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"http://blog.aweber.com/articles-tips/9-ways-you-can-become-an-affiliate-all-star.htm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"http://blog.aweber.com/articles-tips/9-ways-you-can-become-an-affiliate-all-star.htm#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Jan 2015 15:00:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:15:\"Articles & Tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:17:\"Digital Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:15:\"Email Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:19:\"affiliate marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=71658\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:206:\"Affiliate marketing has become a trending topic in the digital marketing community. Find out how you can turn your love of a product into a low-risk, high-reward opportunity - and start reaping the rewards!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Olivia Dello Buono\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4862:\"<p><img class=\"aligncenter wp-image-71794 size-full\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/awesome-affiliate-blogimg.png\" alt=\"awesome-affiliate-blogimg\" width=\"700\" height=\"110\" /></p>\n<p>Affiliate marketing has become a trending topic in the digital marketing community, and for good reason! This low-risk, high-reward opportunity is great for those who want to monetize their love of a product.</p>\n<p>Despite some claims, affiliate marketing won’t make you an overnight millionaire. But that doesn’t mean you can’t make a serious profit. Successful affiliates are advocates for the products they’re referring &#8211; and they’re reaping the rewards!</p>\n<p>Keep reading to find out if affiliate marketing is right for you &#8211; and tips on how you can become an affiliate all-star.</p>\n<h2>What Is Affiliate Marketing?</h2>\n<p>Think of affiliate marketers as the middlemen between clients and brands. Is there a product or service you don’t hesitate to recommend to family or friends? Partnering with these brands is a great way to get rewarded for your endorsement.</p>\n<p>Affiliate marketers earn commission by referring traffic and sales to a retailer’s website through their own promotional efforts. Prospective affiliates can join a program through a merchandiser directly or a network that manages multiple affiliate programs.</p>\n<h2>What Are The Benefits Of Affiliate Marketing?</h2>\n<ul>\n<li><b>Low-Risk, High Reward:</b> Becoming an affiliate usually doesn&#8217;t requires no start-up fees or investment.</li>\n<li><b>Advanced Tracking Tools:</b> A good affiliate program provides you with the tools to measure your campaign’s effectiveness.</li>\n<li><b>No “Selling” Experience Required:</b> It’s as simple as creating good content.</li>\n<li><b>Not Your Average Job:</b> Create a steady flow of income by promoting a company’s products and services.</li>\n</ul>\n<h2>Choosing A Niche</h2>\n<p>When choosing an affiliate marketing program, first ask yourself a few questions:</p>\n<ul>\n<li><em>Are you knowledgeable in the topic?</em></li>\n<li><em>Is the content something people are searching for?</em></li>\n<li><em>What problem are you trying to solve?</em></li>\n<li><em>Is there room for growth? Can you add value to the content?</em></li>\n</ul>\n<p>Your answers will help you identify if a niche is right for you.</p>\n<h2>How Do You Drive Traffic?</h2>\n<p>When you sign up, you’ll receive a unique affiliate commissions code. This is used to track the visitors and sales that were directed from your efforts. But how do you drive traffic to a merchandiser’s website in the first place?</p>\n<p>Some common affiliate promotional strategies include:</p>\n<ul>\n<li>Blogging</li>\n<li>Building up an email list</li>\n<li>Social Media</li>\n<li>Videos + Podcasting</li>\n<li>Writing reviews</li>\n<li>Word-of-mouth</li>\n<li>Paid advertising</li>\n<li>Banners</li>\n<li>Email Marketing</li>\n<li>Social media ads</li>\n<li>Contests</li>\n</ul>\n<p>Don’t be afraid to get creative in your approach! Blogs like <a href=\"http://affiliatetip.com/\">Affiliate Tip</a>, <a href=\"http://www.amnavigator.com/\">AM Navigator</a>, <a href=\"http://www.shareasale.com/\">ShareASale</a> and <a href=\"http://www.abestweb.com/\">ABestWeb</a> are great resources for campaign inspiration.</p>\n<h2>How Do You Build An Audience?</h2>\n<p>There are a number of tracking tools that give you the power to track the reach of your campaigns. Some frequently used services include:</p>\n<ul>\n<li><a href=\"http://www.google.com/analytics/\">Google Analytics</a> is a free service that lets you measure your advertising ROI, track your social reach and manage your applications. With its suite of features, you can analyze visitor traffic and ensure you’re getting the most out of your marketing efforts.</li>\n<li><a href=\"https://www.facebook.com/help/336893449723054/\">Page Insights</a> provides information about user activity on your Facebook page. You can view metrics, identify your most engaging posts and gather information on your audience.</li>\n<li><a href=\"https://www.youtube.com/yt/playbook/yt-analytics.html\">YouTube Analytics</a> lets you monitor the performance of your channel, with up-to-date metrics and reports.</li>\n</ul>\n<h2>9 Ways To Be An Awesome Affiliate</h2>\n<p><img class=\"aligncenter wp-image-71730 size-full\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/9-ways-to-be-an-awesome-affiliate.png\" alt=\"9-ways-to-be-an-awesome-affiliate\" width=\"700\" height=\"1918\" /></p>\n<h2>What’s Next?</h2>\n<p>Have a passion for email marketing? Consider becoming an AWeber affiliate! You’ll receive 30% recurring commission for every referral that signs up for our service. And we provide you with the tools you need for success. Visit our <a href=\"http://www.aweber.com/affiliates.htm\">Partners page</a> to get started.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"http://blog.aweber.com/articles-tips/9-ways-you-can-become-an-affiliate-all-star.htm/feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"3 Ways Your Small Business Can Leverage User Generated Content Now\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"http://blog.aweber.com/articles-tips/3-ways-your-small-business-can-leverage-user-generated-content-now.htm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:116:\"http://blog.aweber.com/articles-tips/3-ways-your-small-business-can-leverage-user-generated-content-now.htm#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 21 Jan 2015 15:00:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Articles & Tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=71285\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:159:\"User-generated content has become a buzzword in the digital marketing world. Find out how your small business can create a successful UGC campaign of your own!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Olivia Dello Buono\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6358:\"<p><img class=\"aligncenter wp-image-71794 size-full\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/UGC-sblogheader.png\" alt=\"user-generated-content-blogimg\" width=\"700\" height=\"110\" /></p>\n<p>User-generated content (or UGC, for short) has become a buzzword in the digital marketing world. And for good reason &#8211; avid social media users are consuming over <a href=\"http://go.crowdtap.com/socialinfluence\">five hours of user-generated content per day</a>. So it&#8217;s no surprise that fan-powered campaigns have proven to be 20 percent more effective on purchasing decisions than their traditional ad counterparts.</p>\n<p>UGC can be a great addition to your marketing strategy, all while boosting engagement and awareness for your brand. Let’s take a look at some of the ways that small businesses (and even AWeber) are crowdsourcing content so you can put together a successful user-powered campaign of your own!</p>\n<h2>Why Is User-Generated Content So Effective For Small Businesses?</h2>\n<p>UGC is a low-investment, high-impact way to generate social conversation between  a brand and its fans. It also has advantages over traditional marketing avenues: reports show that Millennials &#8211; the demographic that holds the most purchasing power &#8211; are <a href=\"http://www.business2community.com/content-marketing/millennials-favor-user-generated-content-0856648\">50 percent more likely to trust reviews from their peers</a> than they are from any other form of media. “Millennials are a generation that wants to co-create the product, the brand, with you,” <a href=\"http://www.forbes.com/sites/micahsolomon/2014/12/29/5-traits-that-define-the-80-million-millennial-customers-coming-your-way/\">says Alex Castellarnau</a> of the file transfer service Dropbox. “Companies that understand this and figure out ways to engage in this co-creation relationship with millennials will have an edge.”</p>\n<p>But even if your company doesn’t cater to Millennials, don’t dismiss the idea of UGC just yet. As technology becomes more prevalent amongst older generations, the same buying behaviors and principles will be considered standard.</p>\n<h2>What Are Some Types Of User-Generated Content?</h2>\n<p>UGC can be as simple as a blog comment or as technical as a video spot. The type of content you collect is really up to you &#8211; just make sure it aligns with your brand messaging.</p>\n<p>Some other types of UGC to consider include:</p>\n<ul>\n<li>Social media posts (i.e. Twitter, Instagram)</li>\n<li>User-submitted photos and videos</li>\n<li>Guest blog posts</li>\n<li>Testimonials</li>\n<li>Public and brand forums</li>\n</ul>\n<h2>How Can Your Small Business Collect User-Generated Content?</h2>\n<h3>1. Hosting a campaign:</h3>\n<p>UGC is a simple and cost-effective way to get exposure for your brand, since entrants are likely to share their entries within their social circles. An easy way to collect content is to run a campaign via social, like we did for <a href=\"https://www.sba.gov/nsbw/nsbw\">National Small Business Week</a>. We celebrated by collecting and sharing the inspirations of small business owners from around the world:</p>\n<p><img class=\"aligncenter wp-image-71787 size-full\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/inspire.jpg\" alt=\"inspire\" width=\"700\" height=\"492\" /></p>\n<blockquote><p><b>Pro Tip:</b> Apps like <a href=\"http://heyo.com/\">Heyo</a>, <a href=\"https://tagboard.com/\">TagBoard</a> and <a href=\"http://keyhole.co/\">Keyhole</a> make aggregating fan content a breeze &#8211; all while engaging fans, collecting new subscribers and converting sales.</p></blockquote>\n<h3>2. Testimonials and Reviews:</h3>\n<p>After a customer makes a purchase on your site, send them a follow up email asking them to rate their purchase. Or invite fan feedback on your social pages, like <a href=\"http://vaultbrewing.com/\">Vault Brewery</a> does on their Facebook page:</p>\n<p><img class=\"aligncenter wp-image-71782 size-full\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/vault.png\" alt=\"vault-review\" width=\"700\" height=\"479\" /></p>\n<blockquote><p><b>Pro Tip:</b> If you’re feeling creative, ask fans to include photos of their purchases (this works especially well for brands with physical products). Consumers are more likely to trust sources that receive positive feedback from peers.</p></blockquote>\n<h3>3. Reposting fan photos:</h3>\n<p>This is one of the easiest ways to work UGC into your social media strategy and a great way add some authenticity to the marketing mix. Take a look at how <a href=\"http://www.skinnytaste.com/\">SkinnyTaste</a> reposts fan content via Instagram:</p>\n<p><img class=\"aligncenter wp-image-71784 size-large\" src=\"http://blog.aweber.com/wp-content/uploads/2014/12/insta2-1024x610.png\" alt=\"insta2\" width=\"640\" height=\"381\" /></p>\n<blockquote><p><strong>Pro Tip:</strong> If you choose to go this route, consider creating a unique brand hashtag and encourage customers to tag and share content (we use #AWeberLife).</p></blockquote>\n<h2>How Can Small Businesses Monitor User-Generated Content?</h2>\n<p>Aggregating fan content through your unique brand hashtag will allow you to track mentions around the social sphere. Bring content from multiple sources together in one place with a social media management platform.</p>\n<p>Sites like <a href=\"http://www.sproutsocial.com/\">Sprout Social</a>, <a href=\"http://www.hootsuite.com/\">HootSuite</a> and <a href=\"http://www.meetedgar.com/\">Edgar</a> are great for monitoring the social pull of your brand. And this is important, since you want your brand&#8217;s perception to stay consistent throughout your messaging. Tools like these allow you to moderate fan submissions, so you&#8217;ll be able to approve and curate content before it hits your sharing stream.</p>\n<h2>Looking Ahead</h2>\n<p>Don’t expect to see UGC going away anytime soon. With social media at the forefront of modern marketing channels, users are consuming and creating authentic content daily. And UGC is easy to implement into your current strategy &#8211; as you’ve seen, many small businesses are already embracing for its quick and cost-effective results. Consider adding UGC to your to-do list today!</p>\n<p><b>Do you have any great examples of brands leveraging user-generated content? Let us know in the comments!</b></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:112:\"http://blog.aweber.com/articles-tips/3-ways-your-small-business-can-leverage-user-generated-content-now.htm/feed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:54:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"Creating Remarkable Experiences: Tips for Providing Great Customer Support\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"http://blog.aweber.com/articles-tips/creating-remarkable-experiences-tips-for-providing-great-customer-support.htm\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:123:\"http://blog.aweber.com/articles-tips/creating-remarkable-experiences-tips-for-providing-great-customer-support.htm#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 20 Jan 2015 17:00:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:15:\"Articles & Tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:16:\"customer service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:21:\"customer service tips\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:16:\"customer support\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:14:\"small business\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.aweber.com/?p=71797\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:197:\"Businesses that offer great customer support not only help their customers, but also create remarkable experiences with their brand. Find out how you can kickstart or improve your support options. \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Sam Hollis\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8311:\"<p><img class=\"aligncenter wp-image-71876 size-full\" src=\"http://blog.aweber.com/wp-content/uploads/2015/01/customer-service-tips-blogimg.png\" alt=\"AWeber-customer-service-tips.jpg\" width=\"700\" height=\"110\" /></p>\n<p>Many people will tell you that customer service is a lost art. From unfriendly personnel to unbearably long wait times, simply getting the help you need can be more of a hassle than it’s worth.</p>\n<p>Though that may be the case for some businesses, you can stand out by striving to make every customer experience a remarkable one. And the happier your customers are with your business, the greater the chance they’ll stick around.</p>\n<p><a href=\"https://www.zendesk.com/resources/customer-service-and-lifetime-customer-value\">According to Zendesk</a>, customer service was ranked as the number one factor that influenced  vendor trust. Additionally, 62 percent of B2B and 42 percent of B2C customers purchased more products after a positive customer service experience. Pretty rewarding, isn’t it?</p>\n<p>With the new year upon us, it’s a great opportunity to start thinking about how you can provide support for your customers. If you already do, now’s the time to re-evaluate how you’re doing.</p>\n<p>Ready to create remarkable experiences for your customers? Here are four ways to get started.</p>\n<p><strong> </strong></p>\n<h2>Where do I start?</h2>\n<p>The first thing to do when evaluating this aspect of your small business is get to know your customers. Before you get into the nitty-gritty, put yourself in their shoes by asking a few questions:</p>\n<ul>\n<li>Who are the people who use my service most?</li>\n<li>What are they looking to achieve?</li>\n<li>What tools do I provide to help them accomplish their goals?</li>\n</ul>\n<p>Once you start thinking about your small business from their point of view, you can move on to figuring out the best way to provide support for your customers.</p>\n<p><strong> </strong></p>\n<h2>What type of support options are available?</h2>\n<p>Everyone is different. Making a meaningful connection with your customers means that you must understand their individuals needs, and as a result, provide support based on their needs.</p>\n<blockquote><p>Tip: Giving your support staff the best tools helps them create more remarkable experiences.</p></blockquote>\n<p>The four main customer solution options are as follows:</p>\n<h3><b></b><b>1. A Central Hub: The FAQ/Educational Resource Center</b></h3>\n<p>Some people prefer to search for their own answers. In these cases, a simple Frequently Asked Questions page is ideal. This is a great place to address general questions your customers might have, such as where your business is located or how to get started. If you find that customers have more in depth questions about your brand or product, you might want to create an educational resource center, sometimes known as a <a href=\"https://help.aweber.com/hc/en-us\">Knowledge Base</a>.</p>\n<p>In both cases, you’re able to provide customers with a one-stop-shop for quick and easy solutions to your most common questions.</p>\n<p>When you set up your FAQ or Knowledge Base, you might also consider including a Contact Us or Support option. If you offer email, phone, or chat support, you can encourage that dialogue through those options.</p>\n<blockquote><p>Tip: Use these articles to identify potential pain points. Look for which ones receive the most attention and see if that aspect of your service can be improved.</p></blockquote>\n<h3><b>2. The One-to-One Connection: Email</b></h3>\n<p>If you’re a solopreneur, email is a great way to communicate with and provide support to your customers. But it can be overwhelming to consider. With the inevitable onslaught of daily correspondence we all receive, how can you possibly manage every email?</p>\n<p>One word: Filters.</p>\n<p>Setting up a filter in your inbox that moves each message to a specific folder labelled “Questions” or “Support” will help organize incoming messages, and give you the ability to better manage your responses.</p>\n<p>Dedicate a chunk of time each day to answering these emails.</p>\n<p>If you find yourself answering the same questions over and over, consider adding a related article to your FAQ or Knowledge Base. You can then link to it in your email replies.</p>\n<p>Other ways to help manage your workflow include:</p>\n<p>&#8211; Keeping a document with common responses</p>\n<p>&#8211; Investigating productivity software, such as TextExpander</p>\n<p>&#8211; Organizing your inbox by date, so you reply to the oldest request first</p>\n<blockquote><p>Tip: Providing timely responses will show customers that you’re actively invested in their success. Be concise and polite.</p></blockquote>\n<h3><b>3. The ‘Real-Time’ You: Online Chat</b></h3>\n<p>If you have built out a team to help customers resolve their issues, consider integrating an online chat platform with your site. You’ll be able to communicate quickly and easily with customers, to provide them with necessary educational resources and support.</p>\n<blockquote><p>Tip: Online chat sessions not only save time, they make it possible to multitask and provide support to several customers at once.</p></blockquote>\n<h3><b>4. The Emotional Connection: Phone Support</b></h3>\n<p>As your business grows, consider adding a dedicated support team that’s available via phones. This provides your customers with a direct line of personal communication. Your team members will be the subject matter experts and brand ambassadors for your company, so remember, they will need to be some level of training prior to taking calls.</p>\n<blockquote><p>Tip: Provide your team with headsets! This may seem like common sense, but being able to have both hands free makes it much easier to provide remarkable support.</p></blockquote>\n<p><strong> </strong></p>\n<h2>What should I say?</h2>\n<p>Now that you know the main ways to connect with customers in need of a little assistance, what should you say to them?</p>\n<p>It’s good to acknowledge and understand your customer’s state of mind from the moment they contact you. Know that a simple apology, or acknowledgement of the issue, will go a long way in building rapport. Here are some key phrases to keep in mind when addressing their issues:</p>\n<ul>\n<li>“I do apologize for the inconvenience&#8230;”</li>\n<li>“I am sorry for any difficulty you may be having&#8230;”</li>\n<li>“I understand your frustration&#8230;”</li>\n</ul>\n<p>Remember to be personal and address your customer directly. Providing the best answer possible comes first, but your personality should always shine through.</p>\n<p>As you consider your response, always ask yourself the following questions:</p>\n<ul>\n<li>Am I acknowledging their issue?</li>\n<li>Am I addressing their frustrations?</li>\n<li>Am I clear and concise in my response?</li>\n</ul>\n<blockquote><p>Tip: Learning to manage the tone in your response can help reduce the stress of your customers and show them that you care.</p></blockquote>\n<p><strong> </strong></p>\n<h2>What if I can&#8217;t handle it on my own?</h2>\n<p>If you’re not quite ready to build out your team, there are alternative options to handling customer inquiries on your own.</p>\n<p>External services, such as <a href=\"http://www.desk.com/\">Desk.com</a>, provide a platform to  help manage incoming inquiries.</p>\n<p>Or, consider outsourcing through third-party companies, like <a href=\"https://www.odesk.com/cat/customer-service\">oDesk</a>. This allows you to hire freelance support staff who are knowledgeable and trained in providing the kind of support you’re looking for.</p>\n<p><strong> </strong></p>\n<h2>Great Customer Support Makes For Great Business</h2>\n<p>At the end of the day, your customers are the most important part of your business. Providing support not only educates them for the future, but allows you to foster respect and open a line of communication that allows everyone to grow. Who knows, you might even use their feedback to better your service! Aside from yourself, your customers are the best people to help make your small business even more awesome.</p>\n<p>Do you have any tips or tricks for providing the most remarkable service possible? Please let us know in the comments!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:119:\"http://blog.aweber.com/articles-tips/creating-remarkable-experiences-tips-for-providing-great-customer-support.htm/