INSERT INTO `wp_posts` VALUES("18", "1", "2015-02-04 11:54:59", "2015-02-04 11:54:59", "<div id=\"totalabout\">\r\n<div id=\"aboutpost\">ABOUT</div>\r\n&nbsp;\r\n<div id=\"abouttitle\">About GotoGodavari Website<a href=\"www.gotogodavari.com\"><img class=\" size-full wp-image-1920 aligncenter\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/f.png\" alt=\"f\" width=\"158\" height=\"94\" /></a></div>\r\n<div id=\"aboutmatter\">This web site mainly developed for Godavari Pushkaralu in india. Actually many strangers struggle a lot in unknown places during the event of Godavari Pushkaralu. In this website I have covered almost all important places of godavari. And also this website contains news and updates about <em>Godavari Pushkaralu</em>.</div>\r\n&nbsp;\r\n<div id=\"abouttitle\">About Founder/Admin of GotoGodavari<a href=\"www.facebook.com/injarapu.balasatishkumar\"><img class=\"  wp-image-600 aligncenter\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/R091074_1201.jpg\" alt=\"R091074_120\" width=\"116\" height=\"149\" /></a></div>\r\n<div id=\"aboutmatter\">BALA SATISH KUMAR INJARAPU, I am the founder of this website. Presently I\'m in B.tech 4th year of Computer Science Engineering in RGUKT at RK Valley. Actually I\'m interested in developing applications which are helpful for society. I have idea on this Pushkaralu event. I think it must be useful for you.This is my first website.I hope this is useful for you.If you get any problem while using this website please comment. This would make me designing this site better. Thank you.\r\nEmail:gotogodavari@gmail.com\r\nAddress:West Godavari,Tallapudi,Annadevara Peta.</div>\r\n&nbsp;\r\n<div id=\"abouttitle\">About Contributor/Author of GotoGodavari</div>\r\n<div id=\"aboutmatter\">\r\n<a href=\"www.gotogodavari.com\"><img class=\"aligncenter wp-image-1972\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/60.jpg\" alt=\"60\" width=\"116\" height=\"149\" /></a>KISHORE MANAMALA, I am the author of this articles in this gotogodavari website. Currently I am doing B.tech with Metallurgy in RGUKT at RK Valley.\r\n</div>\r\n<div id=\"aboutmatter\">\r\nI would like to thank IVK Satyanarayana, Venkata Sai Injarapu, Kishan, D Teja and Ramana Babu for their contribution towards this website.", "ABOUT", "", "publish", "closed", "closed", "", "contact-us", "", "", "2015-02-13 17:44:00", "2015-02-13 17:44:00", "", "0", "http://localhost/gotogodavari/?page_id=18", "0", "page", "", "0");
