INSERT INTO `wp_posts` VALUES("415", "1", "2015-02-13 17:17:19", "2015-02-13 17:17:19", "[tribulant_slideshow]\n<div id=\"textpost1\">\'<strong>Godavari Pushkaralu</strong>\' is a religious festival of mythical river Godavari. This\nevent is scheduled to commence on july 14, 2015. This festival is held once in 12 years. This year\'s <strong>Pushkaram</strong> is called \'<strong>Maha Kumbhamela</strong>\'. This \'Maha Kumbhamela\' comes once every 144 years.There are 24 days in a \'Pushkaram\'. The first 12 days of\n<div>Pushkaram is called \'<strong>Aadi Pushkaram</strong>\' and last 12 days is called \'<strong>Anthya Pushkaram</strong>\'.\nBut, the celebrations in this year starts from 14<sup>th</sup> July and ends on 25<sup>th</sup> July 2015.\nDuring these auspicious days devotees and pilgrims from all over India and abroad\ncomes for a <strong>holy dip in Godavari</strong> with the belief that they would be relieved from\n<div>all sins and to also to perform rituals to the departed souls. The people strongly believe</div>\n<div>that a holy dip in Godavari would enhance their spiritual and mental abilities.This is the</div>\n<div>first \'<strong>Pushkaram</strong>\' after separation of Andhra Pradesh into <strong>Andhra</strong> and <strong>Telangana</strong> regions.</div>", "Home", "", "inherit", "open", "open", "", "32-autosave-v1", "", "", "2015-02-13 17:17:19", "2015-02-13 17:17:19", "", "32", "http://localhost/gotogodavari/32-autosave-v1/", "0", "revision", "", "0");
