INSERT INTO `wp_posts` VALUES("1757", "1", "2015-02-12 17:46:48", "2015-02-12 17:46:48", "\'Godavari pushkaralu\' is a festival of river Godavari. The government of Andhra Pradesh scheduled for \'Godavari Pushkaralu\', which would be held in July of this year. The arragement work will be given to special consultancy to avoid impedances for piligrims. “Government is taking possile steps to facilitate arrangements for pilgrims better than they arranged for 2003 Godavari Pushkaralu”, as stated by superior officers. Control rooms will be arranged and specific schedule will be given to every bathing ghats. Traffic signs and regulations will be prepared on roads of way to bathing ghats for the convenience of devotees. Volunteers will be there to help devotees. By taking all the steps stated above will definitely help the pilgrims.", "Schedule of Godavari Pushkaralu 2015", "", "inherit", "open", "open", "", "1753-revision-v1", "", "", "2015-02-12 17:46:48", "2015-02-12 17:46:48", "", "1753", "http://localhost/gotogodavari/1753-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1758", "1", "2015-02-12 17:47:37", "2015-02-12 17:47:37", "East Godavari District Collector, H. Arun Kumar stated that all the arrangement works should be done in time. He addressed in first empowerment meeting of East and West Godavari districts regarding ‘Godavari Pushkaralu’ in R&amp;B Guesthouse. Regarding this event Special officer, District Collector and officers from various departments attended the meeting. The second meeting will be on 3<sup>rd</sup> February 2015.\r\n\r\nHe said that each and every department should have their specific plan to complete pushkaram woks in a time-bound manner. To meet the requirements of pilgrims he also suggested giving priority for extension of ghats and construction of new ghats. For pushkaram works he agreed to provide the required sand.", "Complete Pushkaram works in time, says Collector H. Arun Kumar", "", "inherit", "open", "open", "", "1754-revision-v1", "", "", "2015-02-12 17:47:37", "2015-02-12 17:47:37", "", "1754", "http://localhost/gotogodavari/1754-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1759", "3", "2015-02-12 02:00:33", "2015-02-12 02:00:33", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">If 6 crore pilgrims will come to take dip....?</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\" wp-image-185 aligncenter\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/confusion-over-year-old-godavari-kumba-mela-grips-pushkaram.jpg\" alt=\"confusion-over-year-old-godavari-kumba-mela-grips-pushkaram\" width=\"812\" height=\"492\" /></a></div>\r\n<div id=\"textpost\">1.It was estimated that 2 crore devotees came to historical city of Rajhmundry for a holy dip in ‘2003 Godavari Pushkaralu’\r\n2.It is expected that the number of pilgrims and devotees will come only to Rajhmundry may reach 6 crore this time.\r\nHighways should be extended for better convenience and for this great event all the pilgrims and devotees should come in queue to avoid inconvenience.</div>\r\n</div>", "If 6 crore pilgrims will come to take dip....?", "", "publish", "open", "open", "", "if-6-crore-pilgrims-will-come-to-take-dip", "", "", "2015-02-13 17:40:36", "2015-02-13 17:40:36", "", "0", "http://localhost/gotogodavari/?p=1759", "0", "post", "", "0");
INSERT INTO `wp_posts` VALUES("1760", "3", "2015-02-12 01:00:58", "2015-02-12 01:00:58", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">Government to start ‘Godavari Pushkaralu’ works in Rajhmundry</div>\r\n<a href=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/gotogodavari.jpg\"><img class=\"aligncenter  wp-image-1875\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/gotogodavari-1024x340.jpg\" alt=\"gotogodavari\" width=\"819\" height=\"272\" /></a>\r\n<div id=\"textpost\">\r\nGovernment decided to start ‘Godavari Pushkaralu’ works as soon as possible. As a meeting was held on this, in this meeting District Collector, special officer and superior officers from various departments has attended. The work will be given by tenders. The second meeting will be held on 3rd February. They planned for Extensification of highways and construction of new bathing ghats should be done for the convenience of pilgrims and devotees. They decided to arrange 244 bathing ghats. They also told they will give more importance to highways that which devotees use to reach bathing ghats and temples. The tenders will be declared on 5th and 12th of next month. They are planning to improve roadways and railways using a total amount of Rs. 3 Crore. They are also extending Godavari bhand raod from 5mt – 10mt with Rs. 3.5 Crore. In this meeting urban S.P Harikrushna, S.E Suguna Rao, public health S.E K.Venu Gopal , D.P.O K. Anand, Transco S.E Gangadhar and others attended.\r\n\r\n</div>", "Government to start ‘Godavari Pushkaralu’ works in Rajhmundry", "", "publish", "open", "open", "", "government-to-start-godavari-pushkaralu-works-in-rajhmundry", "", "", "2015-02-13 17:40:02", "2015-02-13 17:40:02", "", "0", "http://localhost/gotogodavari/?p=1760", "0", "post", "", "0");
