INSERT INTO `wp_posts` VALUES("1868", "1", "2015-02-13 17:44:08", "2015-02-13 17:44:08", "<div id=\"totalabout\">\n<div id=\"aboutpost\">ABOUT</div>\n&nbsp;\n<div id=\"abouttitle\">About GotoGodavari Website<a href=\"www.gotogodavari.com\"><img class=\" size-full wp-image-1920 aligncenter\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/f.png\" alt=\"f\" width=\"158\" height=\"94\" /></a></div>\n<div id=\"aboutmatter\">This web site mainly developed for Godavari Pushkaralu in india. Actually many strangers struggle a lot in unknown places during the event of Godavari Pushkaralu. In this website I have covered almost all important places of godavari. And also this website contains news and updates about <em>Godavari Pushkaralu</em>.</div>\n&nbsp;\n<div id=\"abouttitle\">About Founder/Admin of GotoGodavari<a href=\"www.facebook.com/injarapu.balasatishkumar\"><img class=\"  wp-image-600 aligncenter\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/R091074_1201.jpg\" alt=\"R091074_120\" width=\"116\" height=\"149\" /></a></div>\n<div id=\"aboutmatter\">BALA SATISH KUMAR INJARAPU, I am the founder of this website. Presently I\'m in B.tech 4th year of Computer Science Engineering in RGUKT at RK Valley. Actually I\'m interested in developing applications which are helpful for society. I have idea on this Pushkaralu event. I think it must be useful for you.This is my first website.I hope this is useful for you.If you get any problem while using this website please comment. This would make me designing this site better. Thank you.\nEmail:gotogodavari@gmail.com\nAddress:West Godavari,Tallapudi,Annadevara Peta.</div>\n&nbsp;\n<div id=\"abouttitle\">About Contributor/Author of GotoGodavari</div>\n<div id=\"aboutmatter\">\n<a href=\"www.gotogodavari.com\"><img class=\"aligncenter wp-image-1972\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/60.jpg\" alt=\"60\" width=\"116\" height=\"149\" /></a>KISHORE MANAMALA, I am the author of this articles in this gotogodavari website. Currently I am doing B.tech with Metallurgy in RGUKT at RK Valley.\n</div>\n<div id=\"aboutmatter\">\nI would like to thank IVK Satyanarayana, Venkata Sai Injarapu, Kishan, D Teja and Ramana Babu for their contribution towards this website.", "ABOUT", "", "inherit", "open", "open", "", "18-autosave-v1", "", "", "2015-02-13 17:44:08", "2015-02-13 17:44:08", "", "18", "http://localhost/gotogodavari/18-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1869", "1", "2015-02-13 09:27:31", "2015-02-13 09:27:31", "About\r\n\r\nAbout GotoGodavari Website\r\n\r\nThis web site mainly developed for Godavari Pushkaralu in india. Actually so many strangers struggled a lot in strange unknown places of godavari in the event of pushkaralu. In this web site i covered all important places of godavari. And also this website have news and updates about godavari pushkaralu.\r\n\r\nAbout Founder of GotoGodavari\r\n\r\nBALA,I am the founder of this website. Presently i\'m B.tech 4th year Computer Science student at RGUKT,RK Valley. Actually i\'m interested to develop applications which are helpful for society.And I got idea about godavari pushkaralu.\r\n\r\nThis is my first website.I hope this is useful for you.If you got any problem while using this website please comment me.Thank you.\r\n\r\n&nbsp;", "ABOUT", "", "inherit", "open", "open", "", "18-revision-v1", "", "", "2015-02-13 09:27:31", "2015-02-13 09:27:31", "", "18", "http://localhost/gotogodavari/18-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1870", "1", "2015-02-13 12:31:30", "2015-02-13 12:31:30", "<div id=\'totalpost\'>\n<div id=\'titlepost\'>\nSchedule of Godavari Pushkaralu 2015\n</div>\n<a href=\"http://localhost/gotogodavari/telangana-plans-godavari-pushkaralu-event-on-large-scale/url/\" rel=\"attachment wp-att-1871\"><img class=\"aligncenter size-full wp-image-1871\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/url.jpg\" alt=\"telangana\" width=\"215\" height=\"234\" /></a>\n<div >\n<strong>Godavari pushkaralu</strong> is a festival of mythical river Godavari. The Telangana government planned to organise the <strong>Godavari Pushkaralu</strong> event on the lines of <strong>Kumbh Mela</strong> on large scale. This event is held once for every 12 years.The government is planning for arragements in five districts - Adilabad, Karimnagar, Nizamabad, Khamman and Warangal. The Telangana government plans to spend Rs. 452 crore for this event - from July14-25 of 2015.\n\nCabinet Sub-Committee meeting was held on <strong>Pushkaralu</strong>, Ministers T.Harish Rao, T.Nageshwara Rao and K.Tarakarama Rao and other officials of Panchayat Raj, Roads and Buildings and Irrigation departments participated in the meeting. A. Indrakaran Reddy, the minister for Housing and Endowments stated <em>The government will construct 69 bathing ghats and repair those ghats which were constructed in past. The Vigilance team will keep an eye on the construction of new ghats</em>. The new bathing ghats will be constructed at Basar and Dharmapuri. Devotees and visitors from the country and abroad attend this great event.\n\nThe arrangements includes police control rooms at bathing ghats are made and Rs. 266 crore will spend by Roads and Building department , Rs. 100 crore by Panchayat Raj and Rs. 86 crore by Irrigation departments, as stated by Minister. Chief Minister K. Chandrasekhar Rao would invite Prime Minister Narendra Modi and President Pranab Mukherjee to this event.", "telangana", "", "inherit", "open", "open", "", "1749-autosave-v1", "", "", "2015-02-13 12:31:30", "2015-02-13 12:31:30", "", "1749", "http://localhost/gotogodavari/1749-autosave-v1/", "0", "revision", "", "0");
