INSERT INTO `wp_posts` VALUES("1880", "1", "2015-02-13 11:58:34", "2015-02-13 11:58:34", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">Complete Pushkaram works in time, says Collector H. Arun Kumar</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\"aligncenter wp-image-1879 size-full\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/main.jpg\" alt=\"main\" width=\"550\" height=\"320\" /></a></div>\r\n<div id=\"textpost\">East Godavari District Collector, H. Arun Kumar stated that all the arrangement works should be done in time. He addressed in first empowerment meeting of East and West Godavari districts regarding ‘Godavari Pushkaralu’ in R&amp;B Guesthouse. Regarding this event Special officer, District Collector and officers from various departments attended the meeting. The second meeting will be on 3<sup>rd</sup> February 2015.He said that each and every department should have their specific plan to complete pushkaram woks in a time-bound manner. To meet the requirements of pilgrims he also suggested giving priority for extension of ghats and construction of new ghats. For pushkaram works he agreed to provide the required sand.\r\n\r\n</div>\r\n</div>", "", "", "inherit", "open", "open", "", "1754-revision-v1", "", "", "2015-02-13 11:58:34", "2015-02-13 11:58:34", "", "1754", "http://localhost/gotogodavari/1754-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1881", "1", "2015-02-13 11:59:05", "2015-02-13 11:59:05", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">Complete Pushkaram works in time, says Collector H. Arun Kumar</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\"aligncenter wp-image-1879 size-full\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/main.jpg\" alt=\"main\" width=\"550\" height=\"320\" /></a></div>\r\n<div id=\"textpost\">East Godavari District Collector, H. Arun Kumar stated that all the arrangement works should be done in time. He addressed in first empowerment meeting of East and West Godavari districts regarding ‘Godavari Pushkaralu’ in R&amp;B Guesthouse. Regarding this event Special officer, District Collector and officers from various departments attended the meeting. The second meeting will be on 3<sup>rd</sup> February 2015.He said that each and every department should have their specific plan to complete pushkaram woks in a time-bound manner. To meet the requirements of pilgrims he also suggested giving priority for extension of ghats and construction of new ghats. For pushkaram works he agreed to provide the required sand.</div>\r\n</div>", "local", "", "inherit", "open", "open", "", "1754-revision-v1", "", "", "2015-02-13 11:59:05", "2015-02-13 11:59:05", "", "1754", "http://localhost/gotogodavari/1754-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1883", "1", "2015-02-13 12:27:24", "2015-02-13 12:27:24", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">If 6 crore pilgrims will come to take dip....?</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\" wp-image-185 aligncenter\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/confusion-over-year-old-godavari-kumba-mela-grips-pushkaram.jpg\" alt=\"confusion-over-year-old-godavari-kumba-mela-grips-pushkaram\" width=\"792\" height=\"480\" /></a></div>\r\n<div id=\"textpost\">1.It was estimated that 2 crore devotees came to historical city of Rajhmundry for a holy dip in ‘2003 Godavari Pushkaralu’\r\n2.It is expected that the number of pilgrims and devotees will come only to Rajhmundry may reach 6 crore this time.\r\nHighways should be extended for better convenience and for this great event all the pilgrims and devotees should come in queue to avoid inconvenience.</div>\r\n</div>", "people", "", "inherit", "open", "open", "", "1759-autosave-v1", "", "", "2015-02-13 12:27:24", "2015-02-13 12:27:24", "", "1759", "http://localhost/gotogodavari/1759-autosave-v1/", "0", "revision", "", "0");
