INSERT INTO `wp_posts` VALUES("1891", "1", "2015-02-13 12:18:43", "2015-02-13 12:18:43", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">Telangana plans \'Godavari Pushkaralu\' in five districts</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\"aligncenter  wp-image-1890\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/Telangana-CM-KCR-1024x640.jpg\" alt=\"Telangana-CM-KCR\" width=\"946\" height=\"591\" /></a></div>\r\n<div id=\"textpost\">The government of Telangana is planning observe the \'Godavari Pushakralu\' from July 14 – 25 this year in districts - Adilabad, Karimnagar, Nizamabad, Khamman and Warangal. The main pushkar ghats would be at Vemulavada and Dharmapuri in Karimnagar, Basar in Adilabad and Bhadrachalam in Khammam. The government will construct 69 bathing ghats along the Godavari in five districts and repair those ghats which were constructed in past. The meeting was summoned by Chied Secretary Rajiv Sharma. K.V. Ramanachary, advisor to government on culture told media persons after the meeting to review on arrangements.</div>\r\n</div>", "Telangana Plans about Godavari Pushkaralu", "", "inherit", "open", "open", "", "1752-revision-v1", "", "", "2015-02-13 12:18:43", "2015-02-13 12:18:43", "", "1752", "http://localhost/gotogodavari/1752-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1892", "1", "2015-02-13 12:24:55", "2015-02-13 12:24:55", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">Schedule of Godavari Pushkaralu 2015</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\"aligncenter  wp-image-1894\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/godavari_pushkaralu.jpg\" alt=\"godavari_pushkaralu\" width=\"667\" height=\"380\" /></a></div>\r\n<div id=\"textpost\">\'Godavari pushkaralu\' is a festival of river Godavari. The government of Andhra Pradesh scheduled for \'Godavari Pushkaralu\', which would be held in July of this year. The arragement work will be given to special consultancy to avoid impedances for piligrims. “Government is taking possile steps to facilitate arrangements for pilgrims better than they arranged for 2003 Godavari Pushkaralu”, as stated by superior officers. Control rooms will be arranged and specific schedule will be given to every bathing ghats. Traffic signs and regulations will be prepared on roads of way to bathing ghats for the convenience of devotees. Volunteers will be there to help devotees. By taking all the steps stated above will definitely help the pilgrims.</div>\r\n</div>", "Schedule of Godavari Pushkaralu 2015", "", "inherit", "open", "open", "", "1753-autosave-v1", "", "", "2015-02-13 12:24:55", "2015-02-13 12:24:55", "", "1753", "http://localhost/gotogodavari/1753-autosave-v1/", "0", "revision", "", "0");
