INSERT INTO `wp_posts` VALUES("1895", "1", "2015-02-13 12:24:45", "2015-02-13 12:24:45", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">Schedule of Godavari Pushkaralu 2015</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\"aligncenter  wp-image-1894\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/godavari_pushkaralu.jpg\" alt=\"godavari_pushkaralu\" width=\"667\" height=\"380\" /></a></div>\r\n<div id=\"textpost\">\'Godavari pushkaralu\' is a festival of river Godavari. The government of Andhra Pradesh scheduled for \'Godavari Pushkaralu\', which would be held in July of this year. The arragement work will be given to special consultancy to avoid impedances for piligrims. “Government is taking possile steps to facilitate arrangements for pilgrims better than they arranged for 2003 Godavari Pushkaralu”, as stated by superior officers. Control rooms will be arranged and specific schedule will be given to every bathing ghats. Traffic signs and regulations will be prepared on roads of way to bathing ghats for the convenience of devotees. Volunteers will be there to help devotees. By taking all the steps stated above will definitely help the pilgrims.</div>\r\n</div>", "Schedule of Godavari Pushkaralu 2015", "", "inherit", "open", "open", "", "1753-revision-v1", "", "", "2015-02-13 12:24:45", "2015-02-13 12:24:45", "", "1753", "http://localhost/gotogodavari/1753-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1896", "1", "2015-02-13 12:27:12", "2015-02-13 12:27:12", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">If 6 crore pilgrims will come to take dip....?</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\" wp-image-185 aligncenter\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/confusion-over-year-old-godavari-kumba-mela-grips-pushkaram.jpg\" alt=\"confusion-over-year-old-godavari-kumba-mela-grips-pushkaram\" width=\"792\" height=\"480\" /></a></div>\r\n<div id=\"textpost\">1.It was estimated that 2 crore devotees came to historical city of Rajhmundry for a holy dip in ‘2003 Godavari Pushkaralu’\r\n2.It is expected that the number of pilgrims and devotees will come only to Rajhmundry may reach 6 crore this time.\r\nHighways should be extended for better convenience and for this great event all the pilgrims and devotees should come in queue to avoid inconvenience.</div>\r\n</div>", "people", "", "inherit", "open", "open", "", "1759-revision-v1", "", "", "2015-02-13 12:27:12", "2015-02-13 12:27:12", "", "1759", "http://localhost/gotogodavari/1759-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1897", "1", "2015-02-13 12:31:51", "2015-02-13 12:31:51", "<div id=\'totalpost\'>\r\n<div id=\'titlepost\'>\r\nSchedule of Godavari Pushkaralu 2015\r\n</div>\r\n<a href=\"http://localhost/gotogodavari/telangana-plans-godavari-pushkaralu-event-on-large-scale/url/\" rel=\"attachment wp-att-1871\"><img class=\"aligncenter size-full wp-image-1871\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/url.jpg\" alt=\"telangana\" width=\"215\" height=\"234\" /></a>\r\n<div id=\'textpost\'>\r\n<strong>Godavari pushkaralu</strong> is a festival of mythical river Godavari. The Telangana government planned to organise the <strong>Godavari Pushkaralu</strong> event on the lines of <strong>Kumbh Mela</strong> on large scale. This event is held once for every 12 years.The government is planning for arragements in five districts - Adilabad, Karimnagar, Nizamabad, Khamman and Warangal. The Telangana government plans to spend Rs. 452 crore for this event - from July14-25 of 2015.\r\n\r\nCabinet Sub-Committee meeting was held on <strong>Pushkaralu</strong>, Ministers T.Harish Rao, T.Nageshwara Rao and K.Tarakarama Rao and other officials of Panchayat Raj, Roads and Buildings and Irrigation departments participated in the meeting. A. Indrakaran Reddy, the minister for Housing and Endowments stated <em>The government will construct 69 bathing ghats and repair those ghats which were constructed in past. The Vigilance team will keep an eye on the construction of new ghats</em>. The new bathing ghats will be constructed at Basar and Dharmapuri. Devotees and visitors from the country and abroad attend this great event.\r\n\r\nThe arrangements includes police control rooms at bathing ghats are made and Rs. 266 crore will spend by Roads and Building department , Rs. 100 crore by Panchayat Raj and Rs. 86 crore by Irrigation departments, as stated by Minister. Chief Minister K. Chandrasekhar Rao would invite Prime Minister Narendra Modi and President Pranab Mukherjee to this event.\r\n</div></div>", "telangana", "", "inherit", "open", "open", "", "1749-revision-v1", "", "", "2015-02-13 12:31:51", "2015-02-13 12:31:51", "", "1749", "http://localhost/gotogodavari/1749-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1898", "1", "2015-02-13 12:34:00", "2015-02-13 12:34:00", "<div id=\'totalpost\'>\r\n<div id=\'titlepost\'>\r\nSchedule of Godavari Pushkaralu 2015\r\n</div>\r\n<a href=\"http://localhost/gotogodavari/telangana-plans-godavari-pushkaralu-event-on-large-scale/url/\" rel=\"attachment wp-att-1871\"><img class=\"aligncenter size-full wp-image-1871\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/url.jpg\" alt=\"telangana\" width=\"215\" height=\"234\" /></a>\r\n<div id=\'textpost\'>\r\n<strong>Godavari pushkaralu</strong> is a festival of mythical river Godavari. The Telangana government planned to organise the <strong>Godavari Pushkaralu</strong> event on the lines of <strong>Kumbh Mela</strong> on large scale. This event is held once for every 12 years.The government is planning for arragements in five districts - Adilabad, Karimnagar, Nizamabad, Khamman and Warangal. The Telangana government plans to spend Rs. 452 crore for this event - from July14-25 of 2015.\r\n\r\nCabinet Sub-Committee meeting was held on <strong>Pushkaralu</strong>, Ministers T.Harish Rao, T.Nageshwara Rao and K.Tarakarama Rao and other officials of Panchayat Raj, Roads and Buildings and Irrigation departments participated in the meeting. A. Indrakaran Reddy, the minister for Housing and Endowments stated <em>The government will construct 69 bathing ghats and repair those ghats which were constructed in past. The Vigilance team will keep an eye on the construction of new ghats</em>. The new bathing ghats will be constructed at Basar and Dharmapuri. Devotees and visitors from the country and abroad attend this great event.\r\n\r\nThe arrangements includes police control rooms at bathing ghats are made and Rs. 266 crore will spend by Roads and Building department , Rs. 100 crore by Panchayat Raj and Rs. 86 crore by Irrigation departments, as stated by Minister. Chief Minister K. Chandrasekhar Rao would invite Prime Minister Narendra Modi and President Pranab Mukherjee to this event.\r\n</div></div>", "Schedule of Godavari Pushkaralu 2015", "", "inherit", "open", "open", "", "1749-revision-v1", "", "", "2015-02-13 12:34:00", "2015-02-13 12:34:00", "", "1749", "http://localhost/gotogodavari/1749-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1899", "1", "2015-02-13 12:34:16", "2015-02-13 12:34:16", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">If 6 crore pilgrims will come to take dip....?</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\" wp-image-185 aligncenter\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/confusion-over-year-old-godavari-kumba-mela-grips-pushkaram.jpg\" alt=\"confusion-over-year-old-godavari-kumba-mela-grips-pushkaram\" width=\"792\" height=\"480\" /></a></div>\r\n<div id=\"textpost\">1.It was estimated that 2 crore devotees came to historical city of Rajhmundry for a holy dip in ‘2003 Godavari Pushkaralu’\r\n2.It is expected that the number of pilgrims and devotees will come only to Rajhmundry may reach 6 crore this time.\r\nHighways should be extended for better convenience and for this great event all the pilgrims and devotees should come in queue to avoid inconvenience.</div>\r\n</div>", "If 6 crore pilgrims will come to take dip....?", "", "inherit", "open", "open", "", "1759-revision-v1", "", "", "2015-02-13 12:34:16", "2015-02-13 12:34:16", "", "1759", "http://localhost/gotogodavari/1759-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1900", "1", "2015-02-13 12:35:42", "2015-02-13 12:35:42", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">“Must complete all the arrangements for Godavari Pushkaralu before end of May”: Minister Manikyala Rao</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\"aligncenter size-full wp-image-187\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/siva1.jpg\" alt=\"siva1\" width=\"636\" height=\"464\" /></a></div>\r\n<div id=\"textpost\">Minister Paidikondala Manikyala Rao noted that all the arrangements regarding  <strong>Godavari Pushkaralu</strong> should be completed before end of May-2015. The committee meeting including JSV Prasad, Commissioner YV Anuradha and others participated in the meeting. The committee members decided to build 12 new temples in the place of old ones which were being damaged in the places where this great <strong>Godavari Pushkaralu</strong> event is going to held. Markandeyaswamy temple in Rajhamundry, the other in opposite to railway station and some other temples are included in that list. They stated “immediately start the work in small temples and then in big temples and all the arrangements should be completed in time. The painting works should be started in April and May”.</div>\r\n</div>", "“Must complete all the arrangements for Godavari Pushkaralu before end of May”: Minister Manikyala Rao", "", "inherit", "open", "open", "", "1751-revision-v1", "", "", "2015-02-13 12:35:42", "2015-02-13 12:35:42", "", "1751", "http://localhost/gotogodavari/1751-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1902", "1", "2015-02-13 12:51:53", "2015-02-13 12:51:53", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">Complete Pushkaram works in time, says Collector H. Arun Kumar</div>\r\n<div><a href=\"www.gotogodavari.com\"><img class=\"aligncenter wp-image-1879 \" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/main.jpg\" alt=\"main\" width=\"667\" height=\"388\" /></a></div>\r\n<div id=\"textpost\">East Godavari District Collector, H. Arun Kumar stated that all the arrangement works should be done in time. He addressed in first empowerment meeting of East and West Godavari districts regarding ‘Godavari Pushkaralu’ in R&amp;B Guesthouse. Regarding this event Special officer, District Collector and officers from various departments attended the meeting. The second meeting will be on 3<sup>rd</sup> February 2015.He said that each and every department should have their specific plan to complete pushkaram woks in a time-bound manner. To meet the requirements of pilgrims he also suggested giving priority for extension of ghats and construction of new ghats. For pushkaram works he agreed to provide the required sand.</div>\r\n</div>", "Complete Pushkaram works in time, says Collector H. Arun Kumar", "", "inherit", "open", "open", "", "1754-revision-v1", "", "", "2015-02-13 12:51:53", "2015-02-13 12:51:53", "", "1754", "http://localhost/gotogodavari/1754-revision-v1/", "0", "revision", "", "0");
