INSERT INTO `wp_posts` VALUES("1954", "1", "2015-02-13 16:29:06", "2015-02-13 16:29:06", "[tribulant_slideshow]\r\n<div id=\'textpost\'>\r\n\'Godavari pushkaralu\' is a religious festival of mythical river Godavari. This event is scheduled to commence on july 14, 2015. This festival is held once in 12 years. This year\'s \'Pushkarams\' are called \'Maha Kumbhamela\'. This \'Maha Kumbhamela\' comes once every 144 years.In this year the main event starts from 14th July and ends on 25th July 2015.\r\nDuring these auspicious days devotees and pilgrims from all over India and abroad comes for a holy dip in Godavari with the belief that they would be relieved from all sins and to also to perform rituals to the departed souls. The people strongly believe that a holy dip in Godavari would enhance their spiritual and mental abilities.\r\n</div>", "Home", "", "inherit", "open", "open", "", "32-revision-v1", "", "", "2015-02-13 16:29:06", "2015-02-13 16:29:06", "", "32", "http://localhost/gotogodavari/32-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1912", "1", "2015-02-13 13:54:20", "2015-02-13 13:54:20", "[tribulant_slideshow]\r\n‘Godavari pushkaralu\' is a religious festival of mythical river Godavari. This event is scheduled to commence on july 14, 2015. This festival is held once in 12 years. This year’s ‘Pushkarams’ are called ‘Maha Kumbhamela’. This ‘Maha Kumbhamela’ comes once every 144 years. There are 24 days in a ‘Pushkaram’. The first 12 days of Pushkaram is called ‘Aadi Pushkaram’ and last 12 days is called ‘Anthya Pushkaram’. In this year the main event starts from 14th July and ends on 25th July 2015.\r\n\r\nDuring these auspicious days devotees and pilgrims from all over India and abroad comes for a holy dip in Godavari with the belief that they would be relieved from all sins and to also to perform rituals to the departed souls. The people strongly believe that a holy dip in Godavari would enhance their spiritual and mental abilities.", "Home", "", "inherit", "open", "open", "", "32-revision-v1", "", "", "2015-02-13 13:54:20", "2015-02-13 13:54:20", "", "32", "http://localhost/gotogodavari/32-revision-v1/", "0", "revision", "", "0");
