INSERT INTO `wp_posts` VALUES("1939", "1", "2015-02-13 16:39:21", "2015-02-13 16:39:21", "<div id=\"titlebala\">GODAVARI PUSHKARALU</div>\n<hr/>\n<div id=\"textpost\">\'Godavari Pushkaralu\' is a religious festival of mythical river Godavari. This event is scheduled to commence on july 14, 2015. This festival is held once in 12 years. This year’s \'Pushkarams\' are called \'Maha Kumbhamela\'. This \'Maha Kumbhamela\' comes once every 144 years. There are 24 days in a \'Pushkaram\'. The first 12 days of Pushkaram is called \'Aadi Pushkaram\' and last 12 days is called \'Anthya Pushkaram\'.But, the celebrations in this year starts from 14th July and ends on 25th July 2015.\nDuring these auspicious days devotees and pilgrims from all over India and abroad comes for a holy dip in Godavari with the belief that they would be relieved from all sins and to also to perform rituals to the departed souls. The people strongly believe that a holy dip in Godavari would enhance their spiritual and mental abilities.\nGovernments of both Andhra and Telangana regions are making arrangements grandly for this event. The government of Andhra decided to arrange 250 bathing ghats, build 12 new temples in the place of old ones which were damaged and also to repair some of the old temples, where this \'Godavari Pushkaralu\' event is going to be held. Telangana decided to construct 69 new bathing ghats and also repair the already constructed ghats on the banks of the river for holy dip in this event. This is the first \'Pushkaram\' after separation of Andhra Pradesh into Andhra and Telangana regions.</div>\n<hr/>\n<div id=\"commentlocation\">We will update it soon.If you know more about godavari pushkaralu please share with us.Email id:gotogodavari@gmail.com</div>", "PUSHKARALU", "", "inherit", "open", "open", "", "20-autosave-v1", "", "", "2015-02-13 16:39:21", "2015-02-13 16:39:21", "", "20", "http://localhost/gotogodavari/20-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1943", "1", "2015-02-13 16:16:26", "2015-02-13 16:16:26", "<div id=\'textpost\'>\r\n\'Godavari Pushkaralu\' is a religious festival of mythical river Godavari. This event is scheduled to commence on july 14, 2015. This festival is held once in 12 years. This year’s \'Pushkarams\' are called \'Maha Kumbhamela\'. This \'Maha Kumbhamela\' comes once every 144 years. In this year the main event starts from 14th July and ends on 25th July 2015. \r\nDuring these auspicious days devotees and pilgrims from all over India and abroad comes for a holy dip in Godavari with the belief that they would be relieved from all sins and to also to perform rituals to the departed souls. The people strongly believe that a holy dip in Godavari would enhance their spiritual and mental abilities.\r\nGovernments of both Andhra and Telangana regions are making arrangements grandly for this event. The government of Andhra decided to arrange 250 bathing ghats, build 12 new temples in the place of old ones which were damaged and also to repair some of the old temples, where this \'Godavari Pushkaralu\' event is going to be held. Telangana decided to construct 69 new bathing ghats and also repair the already constructed ghats on the banks of the river for holy dip in this event. This is the first \'Pushkaram\' after separation of Andhra Pradesh into Andhra and Telangana regions. \r\n</div>", "PUSHKARALU", "", "inherit", "open", "open", "", "20-revision-v1", "", "", "2015-02-13 16:16:26", "2015-02-13 16:16:26", "", "20", "http://localhost/gotogodavari/20-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1940", "1", "2015-02-13 16:11:36", "2015-02-13 16:11:36", "\'Godavari Pushkaralu\' is a religious festival of mythical river Godavari. This event is scheduled to commence on july 14, 2015. This festival is held once in 12 years. This year’s \'Pushkarams\' are called \'Maha Kumbhamela\'. This \'Maha Kumbhamela\' comes once every 144 years. There are 24 days in a \'Pushkaram\'. The first 12 days of Pushkaram is called \'Aadi Pushkaram\' and last 12 days is called \'Anthya Pushkaram\'. In this year the main event starts from 14th July and ends on 25th July 2015. \r\nDuring these auspicious days devotees and pilgrims from all over India and abroad comes for a holy dip in Godavari with the belief that they would be relieved from all sins and to also to perform rituals to the departed souls. The people strongly believe that a holy dip in Godavari would enhance their spiritual and mental abilities.\r\nGovernments of both Andhra and Telangana regions are making arrangements grandly for this event. The government of Andhra decided to arrange 250 bathing ghats, build 12 new temples in the place of old ones which were damaged and also to repair some of the old temples, where this \'Godavari Pushkaralu\' event is going to be held. Telangana decided to construct 69 new bathing ghats and also repair the already constructed ghats on the banks of the river for holy dip in this event. This is the first \'Pushkaram\' after separation of Andhra Pradesh into Andhra and Telangana regions. Government of Andhra decided to spend Rs. 222222 crore and while Telangana decided to spend Rs. 122122 crore on this great event.\r\n", "PUSHKARALU", "", "inherit", "open", "open", "", "20-revision-v1", "", "", "2015-02-13 16:11:36", "2015-02-13 16:11:36", "", "20", "http://localhost/gotogodavari/20-revision-v1/", "0", "revision", "", "0");
