INSERT INTO `wp_posts` VALUES("1977", "1", "2015-02-13 17:18:20", "2015-02-13 17:18:20", "[tribulant_slideshow]\r\n<div id=\"textpost1\">\'<strong>Godavari Pushkaralu</strong>\' is a religious festival of mythical river Godavari. This\r\nevent is scheduled to commence on july 14, 2015. This festival is held once in 12 years. This year\'s <strong>Pushkaram</strong> is called \'<strong>Maha Kumbhamela</strong>\'. This \'Maha Kumbhamela\' comes once every 144 years.There are 24 days in a \'Pushkaram\'. The first 12 days of Pushkaram is called \'<strong>Aadi Pushkaram</strong>\' and last 12 days is called \'<strong>Anthya Pushkaram</strong>\'. But, the celebrations in this year starts from 14<sup>th</sup> July and ends on 25<sup>th</sup> July 2015.\r\nDuring these auspicious days devotees and pilgrims from all over India and abroad comes for a <strong>holy dip in Godavari</strong> with the belief that they would be relieved from <div>all sins and to also to perform rituals to the departed souls. The people strongly believe</div> <div>that a holy dip in Godavari would enhance their spiritual and mental abilities.This is the</div> <div>first \'<strong>Pushkaram</strong>\' after bifurcation of Andhra Pradesh into <strong>Andhra</strong> and <strong>Telangana</strong> regions.</div>", "Home", "", "inherit", "open", "open", "", "32-revision-v1", "", "", "2015-02-13 17:18:20", "2015-02-13 17:18:20", "", "32", "http://localhost/gotogodavari/32-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1979", "1", "2015-02-13 17:35:49", "2015-02-13 17:35:49", "<div id=\"totalpost\">\n<div id=\"titlepost\">Government to start ‘Godavari Pushkaralu’ works in Rajhmundry</div>\n<a href=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/gotogodavari.jpg\"><img class=\"aligncenter  wp-image-1875\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/gotogodavari-1024x340.jpg\" alt=\"gotogodavari\" width=\"819\" height=\"272\" /></a>\n\nGovernment decided to start ‘Godavari Pushkaralu’ works as soon as possible. As a meeting was held on this, in this meeting District Collector, special officer and superior officers from various departments has attended. The work will be given by tenders. The second meeting will be held on 3rd February. They planned for Extensification of highways and construction of new bathing ghats should be done for the convenience of pilgrims and devotees. They decided to arrange 244 bathing ghats. They also told they will give more importance to highways that which devotees use to reach bathing ghats and temples. The tenders will be declared on 5th and 12th of next month. They are planning to improve roadways and railways using a total amount of Rs. 3 Crore. They are also extending Godavari bhand raod from 5mt – 10mt with Rs. 3.5 Crore. In this meeting urban S.P Harikrushna, S.E Suguna Rao, public health S.E K.Venu Gopal , D.P.O K. Anand, Transco S.E Gangadhar and others attended.\n\n</div>", "Government to start ‘Godavari Pushkaralu’ works in Rajhmundry", "", "inherit", "open", "open", "", "1760-autosave-v1", "", "", "2015-02-13 17:35:49", "2015-02-13 17:35:49", "", "1760", "http://localhost/gotogodavari/1760-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("1980", "1", "2015-02-13 17:36:16", "2015-02-13 17:36:16", "<div id=\"totalpost\">\r\n<div id=\"titlepost\">Government to start ‘Godavari Pushkaralu’ works in Rajhmundry</div>\r\n<a href=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/gotogodavari.jpg\"><img class=\"aligncenter  wp-image-1875\" src=\"http://localhost/gotogodavari/wp-content/uploads/2015/02/gotogodavari-1024x340.jpg\" alt=\"gotogodavari\" width=\"819\" height=\"272\" /></a>\r\n<div id=\"textpost\">\r\nGovernment decided to start ‘Godavari Pushkaralu’ works as soon as possible. As a meeting was held on this, in this meeting District Collector, special officer and superior officers from various departments has attended. The work will be given by tenders. The second meeting will be held on 3rd February. They planned for Extensification of highways and construction of new bathing ghats should be done for the convenience of pilgrims and devotees. They decided to arrange 244 bathing ghats. They also told they will give more importance to highways that which devotees use to reach bathing ghats and temples. The tenders will be declared on 5th and 12th of next month. They are planning to improve roadways and railways using a total amount of Rs. 3 Crore. They are also extending Godavari bhand raod from 5mt – 10mt with Rs. 3.5 Crore. In this meeting urban S.P Harikrushna, S.E Suguna Rao, public health S.E K.Venu Gopal , D.P.O K. Anand, Transco S.E Gangadhar and others attended.\r\n\r\n</div>", "Government to start ‘Godavari Pushkaralu’ works in Rajhmundry", "", "inherit", "open", "open", "", "1760-revision-v1", "", "", "2015-02-13 17:36:16", "2015-02-13 17:36:16", "", "1760", "http://localhost/gotogodavari/1760-revision-v1/", "0", "revision", "", "0");
